  `deleted` enum('Y','N') DEFAULT 'N',
  `sendStatus` enum('Y','N') DEFAULT 'N',
  PRIMARY KEY (`notificationId`)
) ENGINE=InnoDB AUTO_INCREMENT=64 DEFAULT CHARSET=latin1;

