  `societyId` int(11) NOT NULL AUTO_INCREMENT,
  `societyUniqueId` varchar(55) DEFAULT NULL,
  `societyName` varchar(55) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `cityId` int(11) DEFAULT NULL,
  `societyImage` varchar(55) DEFAULT NULL,
