  PRIMARY KEY (`societyId`),
  KEY `cityId` (`cityId`),
  CONSTRAINT `tbl_society_ibfk_1` FOREIGN KEY (`cityId`) REFERENCES `tbl_cities` (`cityId`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=latin1;

