insert  into `tbl_text` values (1,'Terms&Conditions',NULL,'Terms & Conditions\r\n We value the trust you place in ZOOMNZEE. That\'s why we insist upon the highest\r\nstandards for secure transactions and customer information privacy. Please read the following\r\nstatement to learn about our Privacy Policy. Our Privacy Policy is subject to change at any time\r\nwithout notice. To make sure you are aware of any changes, please check this Privacy Policy\r\nperiodically. If you do not accept any of the modifications or amendments to the terms of this\r\nPrivacy Policy, you should terminate your use of our Website/Application and services offered\r\nthrough it with immediate effect.\r\nData We Collect:\r\nWe collect personally identifiable information (email address, name, phone number, etc.) from\r\nyou when you set up an account with ZOOMNZEE or assigned to you by us. This Privacy\r\nPolicy also applies to data we collect from users who are not registered with our\r\nWebsite/Application for using our services , but browse, access or view our\r\nWebsite/Application, for informational purposes or otherwise.\r\nWe do use your contact information to send you offers based on your previous\r\norders/transactions and your interests. We use personal information to provide the services you\r\nrequest. To the extent we use your personal information to market to you, we will provide you\r\nthe ability to opt-out of such uses.\r\nWe use your personal information to resolve disputes, troubleshoot problems, help promote a\r\nsafe service, collect monies owed, measure consumer interest in our product and services, inform\r\nyou about online and offline offers, products, services, and updates, to customize your\r\nexperience, detect and protect us against error, fraud and other criminal activity, to enforce our\r\nterms and conditions and as otherwise described to you at the time of collection.\r\nIn our efforts to continually improve our product and service offerings, we collect and analyze\r\ndemographic and profile data about our users\' activity on our Website/Application. We identify\r\nand use your IP address to help diagnose problems with our server, and to administer our\r\nwebsite. Your IP address is also used to help identify you and to gather broad demographic\r\ninformation.\r\nWe will occasionally ask you to complete optional online surveys. These surveys may ask you\r\nfor contact information and demographic information (like zip code, age, or income level). We\r\nuse this data to tailor your experience at our site, providing you with content that we think you\r\nmight be interested in and to display content according to your preferences.',NULL,'2018-01-12 14:04:25',NULL,'2018-01-12 14:09:47','N');

