/* Procedure structure for procedure `proc_add_new_rented` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_add_new_rented` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_add_new_rented`(
    p_flatId int(11),
    p_rentedName  VARCHAR(55),
    p_rentedEmail  VARCHAR(55),
    p_rentedOccupation INT(11), 
    p_rentedMobileCount VARCHAR(55),
    p_rentedMobile  VARCHAR(55),
    p_rentedVehicleCount VARCHAR(55),
    p_rentedVehicleType  VARCHAR(55),
    p_rentedVehicleNo  VARCHAR(55),
    p_userId  INT(11)
    )
BEGIN
		update tbl_flat_contact_names set `status` = 'Deactive' where flatId = p_flatId;
		
		update `tbl_flat` set currentStatus = 'rented',currentMode = 'occupied' where flatId = p_flatId;
		
		INSERT INTO `tbl_flat_contact_names` (flatId,`name`,email,occupationId,contactType,`status`,createdBy)
		VALUES (p_flatId,p_rentedName,p_rentedEmail,p_rentedOccupation,'rented','Active',p_userId);
		    
		    INSERT INTO `tbl_flat_contact_vehicles` (flatId,flatContactNameId,vehicleType,vehicleNo,createdBy)
		    SELECT p_flatId,
		    (SELECT MAX(flatContactNameId) FROM `tbl_flat_contact_names` 
		    WHERE flatId=p_flatId AND contactType = 'rented'),
		    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleType, ',', n.n), ',', -1)),
		    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleNo, ',', n.n), ',', -1)),
		    p_userId
		    FROM
		    (    
		    SELECT a.N + b.N * 10 + 1 n
		    FROM
		    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
		    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
		    ORDER BY n
		    ) n
		    WHERE n.n <= 1 + (LENGTH(p_rentedVehicleCount) - LENGTH(REPLACE(p_rentedVehicleCount, ',', '')))
		    AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleCount, ',', n.n), ',', -1));
		    
		    INSERT INTO `tbl_flat_contact_mobile` (flatId,flatContactNameId,mobileNumber,createdBy)
		    SELECT p_flatId,
		    (SELECT MAX(flatContactNameId) FROM `tbl_flat_contact_names` 
		    WHERE flatId=p_flatId AND contactType = 'rented'),
		    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedMobile, ',', n.n), ',', -1)),
		    p_userId
		    FROM
		    (    
		    SELECT a.N + b.N * 10 + 1 n
		    FROM
		    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
		    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
		    ORDER BY n
		    ) n
		    WHERE n.n <= 1 + (LENGTH(p_rentedMobileCount) - LENGTH(REPLACE(p_rentedMobileCount, ',', '')))
		    AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedMobileCount, ',', n.n), ',', -1));
		    
		    INSERT INTO `tbl_users`(userType,linkId,`password`,createdBy)
		    SELECT 'member',mobileId,'123',p_userId FROM `tbl_flat_contact_mobile` 
		    WHERE flatId =p_flatId and flatContactNameId = (SELECT MAX(flatContactNameId) FROM `tbl_flat_contact_names` 
		    WHERE flatId=p_flatId AND contactType = 'rented');
		    
		    SELECT 'New Rented Added Successfully' AS responseMessage;
	    
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_admin_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_admin_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_admin_iud`(
	p_mode INT (11),
	p_adminId INT(11),
	p_uniqueId VARCHAR(55),
	p_adminName VARCHAR(55),
	p_email VARCHAR(55),
	p_mobile VARCHAR(55),
	p_userType VARCHAR(55),
	p_designation VARCHAR(55),
	p_address TEXT,
	p_userId INT(11)
    
    )
BEGIN
	IF p_mode=0
	THEN
	
		INSERT INTO `tbl_admins`(adminUniqueId,`name`,email,mobile,designationId,userType,address)
		VALUES (p_uniqueId,p_adminName,p_email,p_mobile,p_designation,p_userType,p_address);
		
		INSERT INTO `tbl_users`(userType,`password`,linkId,createdBy)
		VALUES('superadmin','123',(SELECT MAX(adminId)FROM `tbl_admins` WHERE deleted='N'),p_userId);
		SELECT 'sucess' AS color,'Admin Created Sucessfully' AS responseMessage;
	END IF;
	
	
	IF p_mode=3
	THEN
		SELECT adminId,adminUniqueId,`name`,email,mobile,address,
		(SELECT typeMasterName FROM `tbl_type_master` WHERE typeMasterId =designationId AND deleted ='N')designationName,
		CASE WHEN userType ='superadmin1'
		THEN
		'Super Admin'
		ELSE
		'Employee'
		END
		userType,
		CASE
		WHEN (SELECT COUNT(linkId) FROM `tbl_users` WHERE linkId=tbl_admins.adminId AND userType ='superadmin' AND deleted = 'N') =0
		THEN
		'N'
		ELSE
		'Y'
		END
		`status`
		FROM `tbl_admins` WHERE deleted = 'N';
	END IF;
	
	IF p_mode=1
	THEN
		SELECT *
		FROM `tbl_admins` WHERE deleted = 'N' AND adminId =p_adminId;
	END IF;
	
	IF p_mode=2
	THEN
		UPDATE `tbl_admins` 
		SET
		`name` = p_adminName , 
		`email` = p_email , 
		`mobile` = p_mobile , 
		address = p_address,
		`designationId` = p_designation , 
		`userType` = p_userType , 
		`updatedBy` = p_userId , 
		`updatedDate` = NOW()
		WHERE
		`adminId` = p_adminId ;
	END IF;
	
	
	
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_change_flat_name_status` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_change_flat_name_status` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_change_flat_name_status`(
    p_flatId int(11),
    p_flatContactNameId int(11),
    p_status varchar(55)
    )
BEGIN
    if p_status = 'Deactive'
    then
	IF (SELECT contactType FROM tbl_flat_contact_names WHERE flatContactNameId = p_flatContactNameId) = 'rented'
	THEN
		UPDATE tbl_flat_contact_names SET `status` = 'Deactive' 
		WHERE flatId = p_flatId;
		
		UPDATE tbl_flat_contact_names SET `status` = 'Active' 
		WHERE flatId = p_flatId
		AND flatContactNameId = p_flatContactNameId;
		
		UPDATE `tbl_flat` SET currentStatus = 'rented',currentMode = 'occupied'
		WHERE flatId = p_flatId;
		SELECT 'Active' AS `newStatus`;
	end if;
	
	IF (SELECT contactType FROM tbl_flat_contact_names WHERE flatContactNameId = p_flatContactNameId) = 'owner'
	THEN
		UPDATE tbl_flat_contact_names SET `status` = 'Deactive' 
		WHERE flatId = p_flatId;
		
		UPDATE tbl_flat_contact_names SET `status` = 'Active' 
		WHERE flatId = p_flatId
		AND flatContactNameId = p_flatContactNameId;
		
		UPDATE `tbl_flat` SET currentStatus = 'owner',currentMode = 'occupied'
		WHERE flatId = p_flatId;
		SELECT 'Active' AS `newStatus`;
	END IF;
	
    end if;
    
    IF p_status = 'Active'
    THEN
	if (select contactType from tbl_flat_contact_names where flatContactNameId = p_flatContactNameId) = 'rented'
	then
		UPDATE tbl_flat_contact_names SET `status` = 'Deactive' 
		WHERE flatId = p_flatId
		AND flatContactNameId = p_flatContactNameId;
		
		update `tbl_flat` set currentStatus = 'owner',currentMode = 'free'
		where flatId = p_flatId;
		SELECT 'Deactive' AS `newStatus`;
	end if;
	
	IF (SELECT contactType FROM tbl_flat_contact_names WHERE flatContactNameId = p_flatContactNameId) = 'owner'
	THEN
		UPDATE tbl_flat_contact_names SET `status` = 'Deactive' 
		WHERE flatId = p_flatId
		AND flatContactNameId = p_flatContactNameId;
		
		UPDATE `tbl_flat` SET currentStatus = 'owner',currentMode = 'free'
		WHERE flatId = p_flatId;
		SELECT 'Deactive' AS `newStatus`;
	END IF;
	
    END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_crone_job_push` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_crone_job_push` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_crone_job_push`()
BEGIN
	
	SELECT t1.societyId,t1.notificationId,t2.userId,t1.title,t2.gcmId,t1.description
	FROM `tbl_notification` AS t1,tbl_users AS t2
	WHERE t1.sendStatus = 'N' AND t2.deleted = 'N' AND t2.userType='member' AND t1.dateTime <= NOW() AND t1.societyId=
	(SELECT societyId FROM `tbl_flat` WHERE flatId=
	(SELECT flatId FROM `tbl_flat_contact_mobile` WHERE mobileId=(SELECT linkId FROM `tbl_users` WHERE deleted='N' AND userId=t2.userId)));
	
	INSERT INTO `tbl_notification_viewed_user`(notificationId,userId)
	SELECT t1.notificationId,t2.userId
	FROM `tbl_notification` AS t1,tbl_users AS t2
	WHERE t1.sendStatus = 'N' AND t2.deleted = 'N' AND t2.userType='member' AND t1.dateTime <= NOW() AND t1.societyId=
	(SELECT societyId FROM `tbl_flat` WHERE flatId=
	(SELECT flatId FROM `tbl_flat_contact_mobile` WHERE mobileId=(SELECT linkId FROM `tbl_users` WHERE deleted='N' AND userId=t2.userId)));
	
	UPDATE tbl_notification SET sendStatus = 'Y' WHERE sendStatus = 'N'  AND `dateTime`<= NOW();
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_drop_down_fetch` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_drop_down_fetch` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_drop_down_fetch`(
    p_type VARCHAR(55),
    p_subType VARCHAR(55)
    )
BEGIN
    IF p_type = 'types'
    THEN
    SELECT typeId,typeName,realTypeName FROM tbl_type WHERE deleted='N';
    END IF;
    
    IF p_type = 'society'
    THEN
    SELECT * FROM `tbl_society` WHERE deleted='N';
    END IF;
    
    IF p_type = 'vendorList'
    THEN
    SELECT * FROM `tbl_vendor` WHERE deleted='N';
    END IF;
    
    IF p_type = 'categoryList'
    THEN
    SELECT * FROM `tbl_type_master` WHERE typeMasterType=(SELECT typeId FROM `tbl_type` WHERE typename='vendorCategory') AND deleted='N';
    END IF;
    
    IF p_type = 'houseKeepingOccupation'
    THEN
    SELECT * FROM `tbl_type_master` WHERE typeMasterType=(SELECT typeId FROM `tbl_type` WHERE typename='housekeepingOccupation') AND deleted='N';
    END IF;
    
    IF p_type = 'supportStaffCategory'
    THEN
    SELECT * FROM `tbl_type_master` WHERE typeMasterType=(SELECT typeId FROM `tbl_type` WHERE typeName='supportStaffCategory');
    END IF;
    
    IF p_type = 'vendorCashMode'
    THEN
        SELECT typeMasterId,typeMasterName FROM `tbl_type_master` AS t1
	LEFT JOIN `tbl_type` AS t2 ON t1.typeMasterType = t2.typeId
	WHERE t1.deleted = 'N' AND t2.deleted = 'N' AND t2.typeName = p_type;
    END IF;
    
    IF p_type = 'superAdminDesignation'
    THEN
        SELECT typeMasterId,typeMasterName FROM `tbl_type_master` AS t1
	LEFT JOIN `tbl_type` AS t2 ON t1.typeMasterType = t2.typeId
	WHERE t1.deleted = 'N' AND t2.deleted = 'N' AND t2.typeName = p_type;
    END IF;
    
    IF p_type = 'importantContact'
    THEN
        SELECT typeMasterId,typeMasterName FROM `tbl_type_master` AS t1
	LEFT JOIN `tbl_type` AS t2 ON t1.typeMasterType = t2.typeId
	WHERE t1.deleted = 'N' AND t2.deleted = 'N' AND t2.typeName = p_type;
    END IF;
    
    IF p_type = 'occupation'
    THEN
        SELECT typeMasterId,typeMasterName FROM `tbl_type_master` AS t1
	LEFT JOIN `tbl_type` AS t2 ON t1.typeMasterType = t2.typeId
	WHERE t1.deleted = 'N' AND t2.deleted = 'N' AND t2.typeName = 'occupation';
    END IF;
    
    
    
    
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_drop_down_fetch_app` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_drop_down_fetch_app` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_drop_down_fetch_app`(
    p_type VARCHAR(255),
    p_societyId varchar(55)
    )
BEGIN
    IF p_type = 'grievanceCategory'
    THEN
        SELECT typeMasterId AS categoryId,typeMasterName AS categoryName FROM `tbl_type_master` AS t1
        LEFT JOIN `tbl_type` AS t2 ON t1.typeMasterType = t2.typeId
        WHERE t1.deleted = 'N' AND t2.deleted = 'N' AND t2.typeName = p_type;
    END IF;
    
    IF p_type = 'occupation'
    THEN
        SELECT typeMasterId AS occupationId,typeMasterName AS occupationName FROM `tbl_type_master` AS t1
        LEFT JOIN `tbl_type` AS t2 ON t1.typeMasterType = t2.typeId
        WHERE t1.deleted = 'N' AND t2.deleted = 'N' AND t2.typeName = p_type;
    END IF;
    
    IF p_type = 'vendorCategory'
    THEN
       SELECT typeMasterId AS categoryId,typeMasterName AS categoryName FROM `tbl_type_master` WHERE deleted='N' AND typeMasterId IN(
	SELECT DISTINCT categoryId FROM `tbl_vendor_category` WHERE deleted='N' AND vendorId IN(SELECT linkId FROM `tbl_users` WHERE deleted='N' AND userId IN
	(SELECT DISTINCT vendorUserId FROM `tbl_user_vendor_society_mapping` 
	WHERE deleted='N' AND DATE(NOW()) BETWEEN validFrom AND validTo AND societyId=p_societyId AND `status`='Approved')));
    END IF;
    
    IF p_type = 'importantContact'
    THEN
        SELECT typeMasterId AS categoryId,typeMasterName AS categoryName FROM `tbl_type_master` AS t1
	LEFT JOIN `tbl_type` AS t2 ON t1.typeMasterType = t2.typeId
	WHERE t1.deleted = 'N' AND t2.deleted = 'N' AND t2.typeName = p_type;
    END IF;
    
    IF p_type = 'housekeepingOccupation'
    THEN
        SELECT typeMasterId AS categoryId,typeMasterName AS categoryName FROM `tbl_type_master`  WHERE typeMasterId IN(
	SELECT categoryId FROM `tbl_housekeeping_staff`WHERE houseKeepingStaffId IN
	(SELECT houseKeepingStaffId FROM `tbl_housekeeping_staff_flat_mapping` WHERE deleted='N' AND societyId=p_societyId) 
	AND deleted='N');
    END IF;
    
     IF p_type = 'Terms&Conditions'
    THEN
        SELECT textDetail FROM tbl_text
	WHERE deleted = 'N'  AND textType = 'Terms&Conditions';
    END IF;
    
    END */$$
DELIMITER ;

