        SELECT typeMasterId,typeMasterName FROM `tbl_type_master` AS t1
	LEFT JOIN `tbl_type` AS t2 ON t1.typeMasterType = t2.typeId
	WHERE t1.deleted = 'N' AND t2.deleted = 'N' AND t2.typeName = p_type;
    END IF;
    
    IF p_type = 'importantContact'
    THEN
        SELECT typeMasterId,typeMasterName FROM `tbl_type_master` AS t1
	LEFT JOIN `tbl_type` AS t2 ON t1.typeMasterType = t2.typeId
	WHERE t1.deleted = 'N' AND t2.deleted = 'N' AND t2.typeName = p_type;
    END IF;
    
    
    
    
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_flat_conatact_details_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_flat_conatact_details_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_flat_conatact_details_iud`(
        p_mode INT (11),
	p_flatId INT(11),
	p_currentStatus VARCHAR(55),
	p_flatContactName VARCHAR(55),
	p_occupationId VARCHAR(55),
	p_mobileNumber VARCHAR(100),
	p_userId INT(11)
    )
BEGIN
    IF p_mode=1
	THEN 
IF EXISTS(SELECT * FROM tbl_flat_contact_mobile WHERE flatId=p_flatId AND deleted='N'
		AND mobileNumber IN (SELECT DISTINCT SUBSTRING_INDEX(SUBSTRING_INDEX(p_mobileNumber, ',', numbers.n), ',', -1) FROM
 numbers))
THEN
SELECT 0 responseCode, 'MobileNo already exists' responseMessage;
ELSE
	        UPDATE tbl_flat 
		SET currentStatus=p_currentStatus 
		WHERE flatId=p_flatId AND deleted='N';
		
		UPDATE `tbl_flat_contact_names`
		SET `name`=p_flatContactName,`occupationId`= p_occupationId
		WHERE `tbl_flat_contact_names`.`flatId`=p_flatId AND deleted='N';
		
		INSERT INTO `tbl_flat_contact_mobile` (flatId,flatContactNameId,mobileNumber,createdBy,createdDate)
		-- SELECT p_flatId,
-- 		(SELECT max(flatContactNameId)FROM tbl_flat_contact_mobile WHERE flatId=p_flatId and deleted='N'),
-- 		p_mobileNumber,p_userId,NOW();
	
SELECT DISTINCT
p_flatId,(SELECT MAX(flatContactNameId)FROM tbl_flat_contact_mobile WHERE flatId=p_flatId AND deleted='N'),
  SUBSTRING_INDEX(SUBSTRING_INDEX(p_mobileNumber, ',', numbers.n), ',', -1)p_mobileNumber,p_userId,NOW()
FROM
 numbers;	
	SELECT 200 responseCode,'flat details updated successfully' responseMessage;	
	 END IF;
     END IF;
    
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_flat_detail_iud` */

