DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_flat_detail_iud`(
/*
owner..
Call proc_flat_detail_iud(1,'12','34','F3803','owner','occupied','admin','Goutam Kumar Sah',NULL,'22',0,NULL,0,0,0,'Amit Pandey','amit@gmail.com','21',0,0,0,0,0,'82','9089786876','58','twoWheeler','gjhgjh','83','9939990452','59','twoWheeler','UK07D2939','5')
Call proc_flat_detail_iud(1,'12','34','F3803','owner','occupied','admin','Goutam Kumar Sah',NULL,'22',0,NULL,0,0,0,'Amit Pandey','amit@gmail.com','21',0,0,0,0,0,'82','9089786876','58','','','83','9939990452','59','twoWheeler','UK07D2939','5')
rented..
Call proc_flat_detail_iud(1,'12','34','F3803','rented','occupied','admin','Goutam Kumar Sah',NULL,'22',0,NULL,0,0,0,'Amit Pandey','tt@dd','21',0,0,0,0,0,'82','9089786876','','','','83','9939990452','59','twoWheeler','dffd','5')
Call proc_flat_detail_iud(1,'12','34','F3803','rented','occupied','admin','Goutam Kumar Sah',NULL,'22',0,NULL,0,0,0,'Amit Pandey','tt@dd','21',0,0,0,0,0,'82','9089786876','','','','83','9939990452','59','','','5')
*/
    p_mode  int(11),
    p_societyId  int(11),
    p_flatId INT(11),
    p_flatNo  varchar(55),
    p_currentStatus  VARCHAR(55),
    p_currentMode  VARCHAR(55),
    p_userType  VARCHAR(55),
    p_ownerName  VARCHAR(55),
    p_ownerEmail  VARCHAR(55),
    p_ownerOccupation  int(11),
    p_ownerMobileCount VARCHAR(55),
    p_ownerMobile  VARCHAR(55),
    p_ownerVehicleCount VARCHAR(55),
    p_ownerVehicleType  VARCHAR(55),
    p_ownerVehicleNo  VARCHAR(55),
    p_rentedName  VARCHAR(55),
    p_rentedEmail  VARCHAR(55),
    p_rentedOccupation int(11), 
    p_rentedMobileCount varchar(55),
    p_rentedMobile  VARCHAR(55),
    p_rentedVehicleCount VARCHAR(55),
    p_rentedVehicleType  VARCHAR(55),
    p_rentedVehicleNo  VARCHAR(55),
    p_ownerMobileOldHiddenIds   varchar(255),
    p_ownerMobileOld   varchar(255),
    p_ownerVehicleOldHiddenIds   varchar(255),
    p_ownerVehicleTypeOld   varchar(255),
    p_ownerVehicleNoOld   varchar(255),
    p_rentedMobileOldHiddenIds   varchar(255),
    p_rentedMobileOld   varchar(255),
    p_rentedVehicleOldHiddenIds   varchar(255),
    p_rentedVehicleTypeOld   varchar(255),
    p_rentedVehicleNoOld   varchar(255),
    p_userId  INT(11)
    )
BEGIN
    if p_mode = 0
    then
	    insert into `tbl_flat` (societyId,flatNo,currentStatus,currentMode,userType,createdBy)
	    values (p_societyId,p_flatNo,p_currentStatus,p_currentMode,p_userType,p_userId);
	    
		    insert into `tbl_flat_contact_names` (flatId,`name`,email,occupationId,contactType,`status`,createdBy)
		    values ((select max(flatId) from `tbl_flat` where societyId=p_societyId),
		    p_ownerName,p_ownerEmail,nullif(p_ownerOccupation,''),'owner',
		    case when p_currentStatus = 'owner'
		    then
		    'Active'
		    else
		    'Deactive'
		    end
		    ,p_userId);
		    
		    INSERT INTO `tbl_flat_contact_vehicles` (flatId,flatContactNameId,vehicleType,vehicleNo,createdBy)
		    SELECT (SELECT MAX(flatId) FROM `tbl_flat` WHERE societyId=p_societyId),
		    (SELECT MAX(flatContactNameId) FROM `tbl_flat_contact_names` 
		    WHERE flatId=(SELECT MAX(flatId) FROM `tbl_flat` WHERE societyId=p_societyId) AND contactType = 'owner'),
		    nullif(TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerVehicleType, ',', n.n), ',', -1)),''),
		    NULLIF(TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerVehicleNo, ',', n.n), ',', -1)),''),
		    p_userId
		    FROM
		    (    
		    SELECT a.N + b.N * 10 + 1 n
		    FROM
		    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
		    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
		    ORDER BY n
		    ) n
		    WHERE n.n <= 1 + (LENGTH(p_ownerVehicleCount) - LENGTH(REPLACE(p_ownerVehicleCount, ',', '')))
		    AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerVehicleCount, ',', n.n), ',', -1));
		    
		    INSERT INTO `tbl_flat_contact_mobile` (flatId,flatContactNameId,mobileNumber,createdBy)
		    SELECT (SELECT MAX(flatId) FROM `tbl_flat` WHERE societyId=p_societyId),
		    (SELECT MAX(flatContactNameId) FROM `tbl_flat_contact_names` 
		    WHERE flatId=(SELECT MAX(flatId) FROM `tbl_flat` WHERE societyId=p_societyId) AND contactType = 'owner'),
		    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerMobile, ',', n.n), ',', -1)),
		    p_userId
		    FROM
		    (    
		    SELECT a.N + b.N * 10 + 1 n
		    FROM
		    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
		    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
		    ORDER BY n
		    ) n
		    WHERE n.n <= 1 + (LENGTH(p_ownerMobileCount) - LENGTH(REPLACE(p_ownerMobileCount, ',', '')))
		    AND nullif (TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerMobileCount, ',', n.n), ',', -1)),'');
		    
	    if p_currentStatus = 'rented'
	    then
		    INSERT INTO `tbl_flat_contact_names` (flatId,`name`,email,occupationId,contactType,`status`,createdBy)
		    VALUES ((SELECT MAX(flatId) FROM `tbl_flat` WHERE societyId=p_societyId),
		    p_rentedName,p_rentedEmail,nullif(p_rentedOccupation,''),'rented','Active',p_userId);
		    
		    INSERT INTO `tbl_flat_contact_vehicles` (flatId,flatContactNameId,vehicleType,vehicleNo,createdBy)
		    SELECT (SELECT MAX(flatId) FROM `tbl_flat` WHERE societyId=p_societyId),
		    (SELECT MAX(flatContactNameId) FROM `tbl_flat_contact_names` 
		    WHERE flatId=(SELECT MAX(flatId) FROM `tbl_flat` WHERE societyId=p_societyId) AND contactType = 'rented'),
		    nullif (TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleType, ',', n.n), ',', -1)),''),
		    nullif (TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleNo, ',', n.n), ',', -1)),''),
		    p_userId
		    FROM
		    (    
		    SELECT a.N + b.N * 10 + 1 n
		    FROM
		    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
		    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
		    ORDER BY n
		    ) n
		    WHERE n.n <= 1 + (LENGTH(p_rentedVehicleCount) - LENGTH(REPLACE(p_rentedVehicleCount, ',', '')))
		    AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleCount, ',', n.n), ',', -1));
		    
		    INSERT INTO `tbl_flat_contact_mobile` (flatId,flatContactNameId,mobileNumber,createdBy)
		    SELECT (SELECT MAX(flatId) FROM `tbl_flat` WHERE societyId=p_societyId),
		    (SELECT MAX(flatContactNameId) FROM `tbl_flat_contact_names` 
		    WHERE flatId=(SELECT MAX(flatId) FROM `tbl_flat` WHERE societyId=p_societyId) AND contactType = 'rented'),
		    NUllif (TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedMobile, ',', n.n), ',', -1)),''),
		    p_userId
		    FROM
		    (    
		    SELECT a.N + b.N * 10 + 1 n
		    FROM
		    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
		    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
		    ORDER BY n
		    ) n
		    WHERE n.n <= 1 + (LENGTH(p_rentedMobileCount) - LENGTH(REPLACE(p_rentedMobileCount, ',', '')))
		    AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedMobileCount, ',', n.n), ',', -1));
	    
	    end if;
	    
	    insert into `tbl_users`(userType,linkId,`password`,createdBy)
	    SELECT 'member',mobileId,'123',p_userId FROM `tbl_flat_contact_mobile` 
	    WHERE flatId =(SELECT MAX(flatId) FROM `tbl_flat` WHERE societyId = p_societyId);
	   
	    
	    select 'Flat Added Successfully' as responseMessage;
    end if;
    
    if p_mode = 3
    then
	    select societyId,flatId,
	    (select societyName from `tbl_society` where tbl_society.societyId = tbl_flat.societyId) as societyName,
	    flatNo,upper(currentStatus) as currentStatus,upper(currentMode) as currentMode,upper(userType) as userType
	    from `tbl_flat` where deleted = 'N' ORDER BY createdDate DESC;
    end if;
    
    IF p_mode = 1
    THEN
	    UPDATE `tbl_flat` SET societyId = p_societyId,flatNo=p_flatNo,currentStatus=p_currentStatus,
	    currentMode=p_currentMode,userType=p_userType,updatedBy=p_userId
	    WHERE flatId = p_flatId;
	    
	    UPDATE tbl_flat_contact_names SET `name` = p_ownerName,email = p_ownerEmail,occupationId = p_ownerOccupation,
	    contactType = 'owner',`status` = 
	    CASE WHEN p_currentStatus = 'owner'
	    THEN
	    'Active'
	    ELSE
	    'Deactive'
	    END
	    ,updatedBy = p_userId WHERE flatId = p_flatId AND contactType = 'owner';
	    
	    UPDATE `tbl_flat_contact_mobile` SET deleted = 'Y' WHERE 
	    flatContactNameId = (SELECT flatContactNameId FROM `tbl_flat_contact_names` WHERE flatId = p_flatId AND contactType = 'owner');
	   
	   if p_ownerVehicleTypeOld != '' AND p_ownerVehicleNoOld != '' 
	   THEN 
	    UPDATE `tbl_flat_contact_vehicles` b,
	    (SELECT TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerVehicleOldHiddenIds, ',', n.n), ',', -1)) AS vehicleId,
	    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerVehicleTypeOld, ',', n.n), ',', -1)) AS vehicleType,
	    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerVehicleNoOld, ',', n.n), ',', -1)) AS vehicleNo,
	    'N' AS deleted
	    FROM
	    (    
	    SELECT a.N + b.N * 10 + 1 n
	    FROM
	    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	    ORDER BY n
	    ) n
	    WHERE n.n <= 1 + (LENGTH(p_ownerVehicleOldHiddenIds) - LENGTH(REPLACE(p_ownerVehicleOldHiddenIds, ',', '')))
	    AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerVehicleOldHiddenIds, ',', n.n), ',', -1)))a
	    SET b.deleted = a.deleted,
	    b.vehicleType = a.vehicleType,b.vehicleNo = a.vehicleNo
	    WHERE b.vehicleId = a.vehicleId;
	    
	   --  SELECT 'a';
	   ELSE
	   UPDATE `tbl_flat_contact_vehicles` SET deleted = 'Y' WHERE 
	    flatContactNameId = (SELECT flatContactNameId FROM `tbl_flat_contact_names` WHERE flatId = p_flatId AND contactType = 'owner');
	    
	   -- SELECT 'b'; 
	  END IF;  
	    
	    
	    UPDATE `tbl_flat_contact_mobile` b,
	    (SELECT TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerMobileOldHiddenIds, ',', n.n), ',', -1)) AS mobileId,
	    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerMobileOld, ',', n.n), ',', -1)) AS mobileNumber,'N' AS deleted
	    FROM
	    (    
	    SELECT a.N + b.N * 10 + 1 n
	    FROM
	    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	    ORDER BY n
	    ) n
	    WHERE n.n <= 1 + (LENGTH(p_ownerMobileOldHiddenIds) - LENGTH(REPLACE(p_ownerMobileOldHiddenIds, ',', '')))
	    AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerMobileOldHiddenIds, ',', n.n), ',', -1)))a
	    SET b.deleted = a.deleted,
	    b.mobileNumber = a.mobileNumber
	    WHERE b.mobileId = a.mobileId;
	    
	    
	    
	    INSERT INTO `tbl_flat_contact_vehicles` (flatId,flatContactNameId,vehicleType,vehicleNo,createdBy)
	    SELECT p_flatId,
	    (SELECT flatContactNameId FROM `tbl_flat_contact_names` 
	    WHERE flatId=p_flatId AND contactType = 'owner'),
	    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerVehicleType, ',', n.n), ',', -1)),
	    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerVehicleNo, ',', n.n), ',', -1)),
	    p_userId
	    FROM
	    (    
	    SELECT a.N + b.N * 10 + 1 n
	    FROM
	    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	    ORDER BY n
	    ) n
	    WHERE n.n <= 1 + (LENGTH(p_ownerVehicleCount) - LENGTH(REPLACE(p_ownerVehicleCount, ',', '')))
	    AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerVehicleCount, ',', n.n), ',', -1));
	    
	    INSERT INTO `tbl_flat_contact_mobile` (flatId,flatContactNameId,mobileNumber,createdBy)
	    SELECT p_flatId,
	    (SELECT flatContactNameId FROM `tbl_flat_contact_names` 
	    WHERE flatId=p_flatId AND contactType = 'owner'),
	    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerMobile, ',', n.n), ',', -1)),
	    p_userId
	    FROM
	    (    
	    SELECT a.N + b.N * 10 + 1 n
	    FROM
	    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	    ORDER BY n
	    ) n
	    WHERE n.n <= 1 + (LENGTH(p_ownerMobileCount) - LENGTH(REPLACE(p_ownerMobileCount, ',', '')))
	    AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_ownerMobileCount, ',', n.n), ',', -1));
	    
	    INSERT INTO `tbl_users`(userType,linkId,`password`,createdBy)
	    SELECT 'member',mobileId,'123',p_userId FROM `tbl_flat_contact_mobile` 
	    WHERE flatId =p_flatId AND flatContactNameId = (SELECT flatContactNameId FROM `tbl_flat_contact_names` 
	    whERE flatId=p_flatId AND contactType = 'owner') 
            AND mobileId NOT IN (SELECT linkId FROM `tbl_users` WHERE userType = 'member');
	    
	    
	IF p_currentStatus = 'rented'
	    THEN
	    if exists (select flatContactNameId from tbl_flat_contact_names 
	    where flatId = p_flatId AND `status` = 'Active' AND contactType = 'rented')
	    then
		UPDATE tbl_flat_contact_names SET `name` = p_rentedName,email = p_rentedEmail,occupationId = p_rentedOccupation,
		updatedBy = p_userId WHERE flatId = p_flatId AND `status` = 'Active' and contactType = 'rented';
	    
		UPDATE `tbl_flat_contact_mobile` SET deleted = 'Y' WHERE 
		flatContactNameId = (SELECT flatContactNameId FROM `tbl_flat_contact_names` 
		WHERE flatId = p_flatId AND contactType = 'rented' AND `status` = 'Active');
		
     IF p_rentedVehicleTypeOld !='' AND p_rentedVehicleNoOld !=''
	   THEN 
	   UPDATE `tbl_flat_contact_vehicles` b,
		(SELECT TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleOldHiddenIds, ',', n.n), ',', -1)) AS vehicleId,
		TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleTypeOld, ',', n.n), ',', -1)) AS vehicleType,
		TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleNoOld, ',', n.n), ',', -1)) AS vehicleNo,
		'N' AS deleted
		FROM
		(    
		SELECT a.N + b.N * 10 + 1 n
		FROM
		(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
		,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
		ORDER BY n
		) n
		WHERE n.n <= 1 + (LENGTH(p_rentedVehicleOldHiddenIds) - LENGTH(REPLACE(p_rentedVehicleOldHiddenIds, ',', '')))
		AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleOldHiddenIds, ',', n.n), ',', -1)))a
		SET b.deleted = a.deleted,
		b.vehicleType = a.vehicleType,b.vehicleNo = a.vehicleNo
		WHERE b.vehicleId = a.vehicleId;
	    
	    SELECT 'rented a';
	   ELSE
	   UPDATE `tbl_flat_contact_vehicles` SET deleted = 'Y' WHERE 
		flatContactNameId = (SELECT flatContactNameId FROM `tbl_flat_contact_names` 
		WHERE flatId = p_flatId AND contactType = 'rented' AND `status` = 'Active');
	    
	   SELECT 'rented b'; 
	  END IF;  
	    
	    
		
	    
		UPDATE `tbl_flat_contact_mobile` b,
		(SELECT TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedMobileOldHiddenIds, ',', n.n), ',', -1)) AS mobileId,
		TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedMobileOld, ',', n.n), ',', -1)) AS mobileNumber,'N' AS deleted
		FROM
		(    
		SELECT a.N + b.N * 10 + 1 n
		FROM
		(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
		,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
		ORDER BY n
		) n
		WHERE n.n <= 1 + (LENGTH(p_rentedMobileOldHiddenIds) - LENGTH(REPLACE(p_rentedMobileOldHiddenIds, ',', '')))
		AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedMobileOldHiddenIds, ',', n.n), ',', -1)))a
		SET b.deleted = a.deleted,
		b.mobileNumber = a.mobileNumber
		WHERE b.mobileId = a.mobileId;
	    
-- 		UPDATE `tbl_flat_contact_vehicles` b,
-- 		(SELECT TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleOldHiddenIds, ',', n.n), ',', -1)) AS vehicleId,
-- 		TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleTypeOld, ',', n.n), ',', -1)) AS vehicleType,
-- 		TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleNoOld, ',', n.n), ',', -1)) AS vehicleNo,
-- 		'N' AS deleted
