-- 		,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
-- 		ORDER BY n
-- 		) n
-- 		WHERE n.n <= 1 + (LENGTH(p_rentedVehicleOldHiddenIds) - LENGTH(REPLACE(p_rentedVehicleOldHiddenIds, ',', '')))
-- 		AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleOldHiddenIds, ',', n.n), ',', -1)))a
-- 		SET b.deleted = a.deleted,
-- 		b.vehicleType = a.vehicleType,b.vehicleNo = a.vehicleNo
-- 		WHERE b.vehicleId = a.vehicleId;
	    else
		INSERT INTO `tbl_flat_contact_names` (flatId,`name`,email,occupationId,contactType,`status`,createdBy)
		VALUES (p_flatId,p_rentedName,p_rentedEmail,p_rentedOccupation,'rented','Active',p_userId);
	    end if;
	    
	    INSERT INTO `tbl_flat_contact_vehicles` (flatId,flatContactNameId,vehicleType,vehicleNo,createdBy)
	    SELECT p_flatId,
	    (SELECT flatContactNameId FROM `tbl_flat_contact_names` 
	    WHERE flatId=p_flatId AND contactType = 'rented' and `status` = 'Active'),
	    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleType, ',', n.n), ',', -1)),
	    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleNo, ',', n.n), ',', -1)),
	    p_userId
	    FROM
	    (    
	    SELECT a.N + b.N * 10 + 1 n
	    FROM
	    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	    ORDER BY n
	    ) n
	    WHERE n.n <= 1 + (LENGTH(p_rentedVehicleCount) - LENGTH(REPLACE(p_rentedVehicleCount, ',', '')))
	    AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedVehicleCount, ',', n.n), ',', -1));
	    
	    INSERT INTO `tbl_flat_contact_mobile` (flatId,flatContactNameId,mobileNumber,createdBy)
	    SELECT p_flatId,
	    (SELECT flatContactNameId FROM `tbl_flat_contact_names` 
	    WHERE flatId=p_flatId AND contactType = 'rented' and `status` = 'Active'),
	    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedMobile, ',', n.n), ',', -1)),
	    p_userId
	    FROM
	    (    
	    SELECT a.N + b.N * 10 + 1 n
	    FROM
	    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	    ORDER BY n
	    ) n
	    WHERE n.n <= 1 + (LENGTH(p_rentedMobileCount) - LENGTH(REPLACE(p_rentedMobileCount, ',', '')))
	    AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_rentedMobileCount, ',', n.n), ',', -1));
	    
	    INSERT INTO `tbl_users`(userType,linkId,`password`,createdBy)
	    SELECT 'member',mobileId,'123',p_userId FROM `tbl_flat_contact_mobile` 
	    WHERE flatId =p_flatId AND flatContactNameId = (SELECT flatContactNameId FROM `tbl_flat_contact_names` 
	    WHERE flatId=p_flatId AND contactType = 'rented' AND `status` = 'Active') 
            AND mobileId NOT IN (SELECT linkId FROM `tbl_users` WHERE userType = 'member');
	    
	   
	end if; 
	    
	    SELECT 'Flat Updated Successfully' AS responseMessage;
    END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_forgot_password_app` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_forgot_password_app` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_forgot_password_app`(
    p_userType VARCHAR(55),
    p_mobile VARCHAR(55)
    )
BEGIN
	
	IF p_userType = 'vendor'
	THEN
		IF EXISTS(SELECT t2.userId,t1.mobile,t1.vendorName FROM `tbl_vendor` AS t1
			LEFT JOIN `tbl_users` AS t2 ON t1.vendorId = t2.linkId
			WHERE t1.mobile = p_mobile AND t1.deleted = 'N' AND t2.userType = p_userType 
			AND t2.deleted = 'N')
		THEN
			SELECT '200' AS responseCode,'Password send to your mobile' AS responseMessage,
			t2.userId,t1.mobile,t2.password FROM `tbl_vendor` AS t1
			LEFT JOIN `tbl_users` AS t2 ON t1.vendorId = t2.linkId
			WHERE t1.mobile = p_mobile AND t1.deleted = 'N' AND t2.userType = p_userType 
			AND t2.deleted = 'N';
		ELSE
			SELECT '0' AS responseCode,'User not exist' AS responseMessage;
		END IF;
			
	END IF;
	
	IF p_userType = 'member'
    THEN
        IF EXISTS(SELECT t1.userId
            FROM `tbl_users` AS t1
            LEFT JOIN `tbl_flat_contact_mobile` AS t2 ON t1.linkId = t2.mobileId
            LEFT JOIN `tbl_flat` AS t3 ON t2.flatId = t3.flatId
            LEFT JOIN `tbl_society` AS t4 ON t3.societyId = t4.societyId
            WHERE t1.userType = p_userType AND t2.mobileNumber = p_mobile 
            AND t1.deleted = 'N' AND t2.deleted = 'N' AND t3.deleted = 'N' AND t4.deleted = 'N')
        THEN
            SELECT '200' AS responseCode,'Password send to your mobile' AS responseMessage,
            t1.userId,t1.userType,t1.password,t1.profileImage,t1.gcmId,t2.mobileNumber,
            t3.flatNo,t3.userType AS userSubType,t4.societyId,t4.societyUniqueId,t4.societyName,t4.address
            FROM `tbl_users` AS t1
            LEFT JOIN `tbl_flat_contact_mobile` AS t2 ON t1.linkId = t2.mobileId
            LEFT JOIN `tbl_flat` AS t3 ON t2.flatId = t3.flatId
            LEFT JOIN `tbl_society` AS t4 ON t3.societyId = t4.societyId
            WHERE t1.userType = p_userType AND t2.mobileNumber = p_mobile 
            AND t1.deleted = 'N' AND t2.deleted = 'N' AND t3.deleted = 'N' AND t4.deleted = 'N';
        ELSE
            SELECT '0' AS responseCode,'User not exist' AS responseMessage;
        END IF;
            
    END IF;
	
	
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_housekeeping_staff_flat_mapping_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_housekeeping_staff_flat_mapping_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_housekeeping_staff_flat_mapping_iud`(
	P_mode INT (11),
	p_occupation INT(11),
	p_houseKeepingStaff INT(11),
	p_society INT(11),
	p_flatId VARCHAR(55),
	p_userId VARCHAR(55)
    )
BEGIN
	IF p_mode=0
	THEN
	
	INSERT INTO `tbl_housekeeping_staff_flat_mapping` (houseKeepingStaffId,societyId,flatId,createdBy)
	   SELECT * FROM(SELECT p_houseKeepingStaff AS houseKeepingStaffId,p_society AS societyId,
	   TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_flatId, ',', n.n), ',', -1))AS flatId,p_userId AS userId
	    FROM
	    (    
	   SELECT a.N + b.N * 10 + 1 n
	    FROM
	   (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	  ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	   ORDER BY n
	) n
	WHERE n.n <= 1 + (LENGTH(p_flatId) - LENGTH(REPLACE(p_flatId, ',', '')))
	AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_flatId, ',', n.n), ',', -1)))a
	WHERE a.houseKeepingStaffId NOT IN 
	(SELECT houseKeepingStaffId FROM tbl_housekeeping_staff_flat_mapping WHERE houseKeepingStaffId=a.houseKeepingStaffId AND societyId=a.societyId AND flatId=a.flatId AND deleted='N');
	SELECT 'Housekeeping staff flat Mapping inserted Successfully.' AS responseMessage,'success' AS color;
	END IF;
	
	IF p_mode=3
	THEN
		SELECT t1.societyId,t1.housekeepingStaffFlatmappingId,t1.houseKeepingStaffId,t1.flatId,t2.typeMasterName,
		t3.name,t4.societyName,t5.flatNo FROM `tbl_housekeeping_staff_flat_mapping` t1
		LEFT JOIN `tbl_housekeeping_staff` t3 ON t1.houseKeepingStaffId=t3.housekeepingStaffId
		LEFT JOIN `tbl_type_master` t2 ON t3.categoryId=t2.typeMasterId
		LEFT JOIN `tbl_society` t4 ON t1.societyId=t4.societyId
		LEFT JOIN `tbl_flat` t5 ON t1.flatId=t5.flatId
		WHERE t1.deleted='N'
		AND
		CASE WHEN p_society != ''
		THEN 
		t1.societyId='1'
		ELSE
		1=1
		END;
	END IF;
	
	IF p_mode=2
	THEN
	DROP  TEMPORARY TABLE IF EXISTS `tmp_housekeeping_saff_flat_mapping`; 
	CREATE  TEMPORARY TABLE tmp_housekeeping_saff_flat_mapping 
	   (
	   
	   houseKeepingStaffId VARCHAR(250),
	   societyId VARCHAR(250),
	   flatId VARCHAR(250),
	   createdBy VARCHAR(250)
	   );
	   
	   INSERT INTO tmp_housekeeping_saff_flat_mapping (houseKeepingStaffId,societyId,flatId,createdBy)
	SELECT * FROM(SELECT p_houseKeepingStaff AS houseKeepingStaffId,p_society AS societyId,
	   TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_flatId, ',', n.n), ',', -1))AS flatId,p_userId AS userId
	    FROM
	    (    
	   SELECT a.N + b.N * 10 + 1 n
	    FROM
	   (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	  ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	   ORDER BY n
	) n
	WHERE n.n <= 1 + (LENGTH(p_flatId) - LENGTH(REPLACE(p_flatId, ',', '')))
	AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_flatId, ',', n.n), ',', -1)))a;
	
	INSERT INTO tbl_housekeeping_staff_flat_mapping (houseKeepingStaffId,societyId,flatId,createdBy)
	SELECT * FROM tmp_housekeeping_saff_flat_mapping WHERE tmp_housekeeping_saff_flat_mapping.houseKeepingStaffId NOT IN 
	(SELECT houseKeepingStaffId FROM tbl_housekeeping_staff_flat_mapping WHERE 
	houseKeepingStaffId=tmp_housekeeping_saff_flat_mapping.houseKeepingStaffId AND
	societyId=tmp_housekeeping_saff_flat_mapping.societyId 
	AND flatId=tmp_housekeeping_saff_flat_mapping.flatId);
	
	UPDATE tbl_housekeeping_staff_flat_mapping
	SET deleted='Y',updatedBy=p_userId,updatedDate=NOW()
	WHERE houseKeepingStaffId NOT IN (SELECT houseKeepingStaffId FROM tmp_housekeeping_saff_flat_mapping WHERE 
	tmp_housekeeping_saff_flat_mapping.houseKeepingStaffId=tbl_housekeeping_staff_flat_mapping.houseKeepingStaffId AND
	tmp_housekeeping_saff_flat_mapping.societyId=tbl_housekeeping_staff_flat_mapping.societyId AND
	tmp_housekeeping_saff_flat_mapping.flatId=tbl_housekeeping_staff_flat_mapping.flatId )
	AND houseKeepingStaffId=p_houseKeepingStaff;
	 
	UPDATE 
	`tbl_housekeeping_staff_flat_mapping`
	SET deleted='N',updatedBy=p_userId,updatedDate=NOW()
	WHERE houseKeepingStaffId IN (SELECT houseKeepingStaffId FROM tmp_housekeeping_saff_flat_mapping WHERE 
	tmp_housekeeping_saff_flat_mapping.houseKeepingStaffId=tbl_housekeeping_staff_flat_mapping.houseKeepingStaffId AND
	tmp_housekeeping_saff_flat_mapping.societyId=tbl_housekeeping_staff_flat_mapping.societyId AND
	tmp_housekeeping_saff_flat_mapping.flatId=tbl_housekeeping_staff_flat_mapping.flatId)
	AND houseKeepingStaffId=p_houseKeepingStaff AND deleted='Y';
	SELECT 'HouseKeeping Staff-Flat mapping updated Successfully.' AS responseMessage,'success' AS color;
	END IF;
	
	
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_housekeeping_staff_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_housekeeping_staff_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_housekeeping_staff_iud`(
	P_mode INT (11),
	p_housekeepingStaffId INT(11),
	p_name VARCHAR(55),
	p_mobile VARCHAR(55),
	p_otherMobile VARCHAR(55),
	p_aadhar VARCHAR(55),
	p_occupation VARCHAR(55),
	p_verify VARCHAR(55),
	p_photo VARCHAR(55),
	p_userId VARCHAR(55)
    )
BEGIN
	IF p_mode=0
	THEN
	
	INSERT INTO `tbl_housekeeping_staff` 
	(`name`,mobile,otherMobile,aadhar,categoryId,`status`,photo,createdBy)
	VALUES
	(p_name,p_mobile,p_otherMobile,p_aadhar,p_occupation,p_verify,p_photo,p_userId);
	
	SELECT 'Housekeeping staff created successfully' AS responseMessage,'success' AS color;
	END IF;
	
	IF p_mode=3
	THEN
		SELECT  t1.housekeepingStaffId,t1.name,t1.mobile,t1.otherMobile,t1.aadhar,t1.categoryId,
		t1.photo,t1.deleted,t2.typeMasterName,t1.status AS verification,
		CASE WHEN 
		(SELECT COUNT(houseKeepingStaffId) FROM `tbl_housekeeping_staff_flat_mapping` WHERE deleted='N' AND
		 tbl_housekeeping_staff_flat_mapping.houseKeepingStaffId=t1.housekeepingStaffId) =0
		 THEN
		 'N'
		 ELSE
		 'Y'
		 END
		`status`
		FROM `tbl_housekeeping_staff` t1
		LEFT JOIN `tbl_type_master` t2 ON t1.categoryId=t2.typeMasterId;
	END IF;
	
	IF p_mode=2
	THEN
	UPDATE `tbl_housekeeping_staff` SET `name`=p_name,mobile=p_mobile,otherMobile=p_otherMobile,`status`=p_verify,
	aadhar=p_aadhar,categoryId=p_occupation,updatedBy=p_userId
	WHERE housekeepingStaffId=p_housekeepingStaffId;
	IF p_photo !=''
	THEN
	UPDATE `tbl_housekeeping_staff` SET  photo =p_photo WHERE housekeepingStaffId=p_housekeepingStaffId;
	
	END IF;
	SELECT 'Housekeeping staff updated successfully' AS responseMessage,'success' AS color;
	
	
	END IF;
	
	
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_important_contacts_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_important_contacts_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_important_contacts_iud`(
	p_mode INT (11),
	p_id INT(11),
	p_name VARCHAR(55),
	p_mobile VARCHAR(55),
	p_type INT(11),
	p_society INT(11),
	p_userId INT(11),
	p_societyId INT(11)
    
    )
BEGIN
	IF p_mode=0
	THEN
	
		
		INSERT INTO `tbl_important_contacts`(`societyId`,`categoryId`,`name`,`mobile`,`createdBy`)
		VALUES
		(p_society,p_type,p_name,p_mobile,p_userId);
		SELECT 'sucess' AS color,'Contact Created Sucessfully' AS responseMessage;
	END IF;
	
	
	IF p_mode=3
	THEN
		SELECT importantContactId,`name`,mobile,
		(SELECT societyName FROM `tbl_society` WHERE societyId = tbl_important_contacts.societyId AND deleted ='N')societyName,
		 (SELECT typeMasterName FROM `tbl_type_master` WHERE typeMasterId=tbl_important_contacts.categoryId AND deleted ='N')typeMasterName
		FROM `tbl_important_contacts`  WHERE deleted = 'N' AND societyId=IFNULL(NULLIF(p_societyId,''),societyId);
	END IF;
	
	IF p_mode=1
	THEN
		SELECT *
		FROM `tbl_important_contacts` WHERE deleted = 'N' AND importantContactId =p_id;
	END IF;
	
	IF p_mode=2
	THEN
		
		UPDATE `tbl_important_contacts` 
		SET
		`societyId` = p_society , 
		`categoryId` =p_type , 
		`name` = p_name , 
		`mobile` = p_mobile , 
		`updatedBy` = p_userId , 
		`updatedDate` = NOW() 
		WHERE
		`importantContactId` = p_id ;
	END IF;
	
	
	
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_login_validation` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_login_validation` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_login_validation`(
/*
Procedure Name - proc_login_validation
Purpose        - To validate the login of users
Author         - Shashank Chauhan
Date           - 30/12/2016
CALL proc_login_validation('9650221794','123456','')
*/
p_userType VARCHAR(50),
p_userName VARCHAR(50), 
p_password VARCHAR(50)
)
BEGIN
  /***Insert start***/
	IF p_userType = 'member'
	THEN
		IF EXISTS(SELECT t1.userId FROM `tbl_users` AS t1
			LEFT JOIN `tbl_flat_contact_mobile` AS t2 ON t1.linkId = t2.mobileId
			LEFT JOIN `tbl_flat` AS t3 ON t2.flatId = t3.flatId
			WHERE t1.userType = p_userType AND t1.deleted = 'N' AND t2.deleted = 'N' AND t3.deleted = 'N' 
			AND t1.password = p_password AND t2.mobileNumber = p_userName AND t3.userType = 'admin')
		THEN
			SELECT '200' AS responseCode,'User login successfully' AS responseMessage,
			t1.userId,t1.userType,
			t2.mobileNumber
			,t3.societyId,t3.userType AS userSubType,
			t4.name,t4.email,t5.societyName FROM `tbl_users` AS t1
			LEFT JOIN `tbl_flat_contact_mobile` AS t2 ON t1.linkId = t2.mobileId
			LEFT JOIN `tbl_flat` AS t3 ON t2.flatId = t3.flatId
			LEFT JOIN `tbl_flat_contact_names` AS t4 ON t2.flatContactNameId = t4.flatContactNameId
			LEFT JOIN `tbl_society` AS t5 ON t3.societyId=t5.societyId
			WHERE t1.userType = p_userType AND t1.deleted = 'N' AND t2.deleted = 'N' AND t3.deleted = 'N' 
			AND t1.password = p_password AND t2.mobileNumber = p_userName AND t3.userType = 'admin';
		ELSE
			SELECT '0' AS responseCode,'User not exist' AS responseMessage;
		END IF;
			
	END IF;
	
	IF p_userType = 'superadmin'
	THEN
		IF EXISTS(SELECT t1.userId FROM `tbl_users` AS t1 
			LEFT JOIN `tbl_admins` AS t2 ON t1.linkId = t2.adminId
			WHERE t1.userType = p_userType AND t1.deleted = 'N' 
			AND t2.mobile = p_userName AND t1.password = p_password AND t2.deleted = 'N')
		THEN
			SELECT '200' AS responseCode,'User login successfully' AS responseMessage,
			t1.userId,t1.userType,t2.userType AS userSubType,t2.name,t2.email,t2.mobile AS mobileNumber FROM `tbl_users` AS t1 
			LEFT JOIN `tbl_admins` AS t2 ON t1.linkId = t2.adminId
			WHERE t1.userType = p_userType AND t1.deleted = 'N' 
			AND t2.mobile = p_userName AND t1.password = p_password AND t2.deleted = 'N';
		ELSE
			SELECT '0' AS responseCode,'User not exist' AS responseMessage;
		END IF;
			
	END IF;
	
END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_login_validation_app` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_login_validation_app` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_login_validation_app`(
    p_userType VARCHAR(55),
    p_mobile VARCHAR(55),
    p_password VARCHAR(55),
    p_societyUniqueId VARCHAR(55),
    p_flatNumber VARCHAR(55)
    )
BEGIN
	
	IF p_userType = 'vendor'
	THEN
		IF EXISTS(SELECT t2.userId,t1.mobile,t1.vendorName FROM `tbl_vendor` AS t1
			LEFT JOIN `tbl_users` AS t2 ON t1.vendorId = t2.linkId
			WHERE t1.mobile = p_mobile AND t1.deleted = 'N' AND t2.userType = p_userType 
			AND t2.password = p_password AND t2.deleted = 'N')
		THEN
			SELECT '200' AS responseCode,'User login successfully' AS responseMessage,
			t2.userId,t1.mobile,t1.vendorName,t1.shopName,t1.vendorUniqueId,t2.loginFirst FROM `tbl_vendor` AS t1
			LEFT JOIN `tbl_users` AS t2 ON t1.vendorId = t2.linkId
			WHERE t1.mobile = p_mobile AND t1.deleted = 'N' AND t2.userType = p_userType 
			AND t2.password = p_password AND t2.deleted = 'N';
			
			IF (SELECT t2.loginFirst FROM `tbl_vendor` AS t1
			LEFT JOIN (SELECT linkId,loginFirst,userType,`password`,deleted FROM `tbl_users`) AS t2 ON t1.vendorId = t2.linkId
			WHERE t1.mobile = p_mobile AND t1.deleted = 'N' AND t2.userType = p_userType 
			AND t2.password = p_password AND t2.deleted = 'N') = 'N'
			
			THEN
			
			UPDATE `tbl_users` SET loginFirst = 'Y'  WHERE userId =(SELECT t2.userId FROM `tbl_vendor` AS t1
			LEFT JOIN (SELECT userId,linkId,loginFirst,userType,`password`,deleted FROM`tbl_users`) AS t2 ON t1.vendorId = t2.linkId
			WHERE t1.mobile = p_mobile AND t1.deleted = 'N' AND t2.userType = p_userType 
			AND t2.password = p_password AND t2.deleted = 'N');
					
			END IF;
		ELSE
			SELECT '0' AS responseCode,'User not exist' AS responseMessage;
		END IF;
			
	END IF;
	
	IF p_userType = 'member'
	    THEN
		IF EXISTS(SELECT t1.userId
		    FROM `tbl_users` AS t1
		    LEFT JOIN `tbl_flat_contact_mobile` AS t2 ON t1.linkId = t2.mobileId
		    LEFT JOIN `tbl_flat` AS t3 ON t2.flatId = t3.flatId
		    LEFT JOIN `tbl_society` AS t4 ON t3.societyId = t4.societyId
		    WHERE t1.userType = p_userType AND t2.mobileNumber = p_mobile 
		    AND t1.deleted = 'N' AND t2.deleted = 'N' AND t3.flatNo = p_flatNumber AND t3.deleted = 'N'
		    AND t4.societyUniqueId = p_societyUniqueId AND t4.deleted = 'N')
		THEN
		    UPDATE `tbl_users` AS t1 
		    LEFT JOIN `tbl_flat_contact_mobile` AS t2 ON t1.linkId = t2.mobileId
		    LEFT JOIN `tbl_flat` AS t3 ON t2.flatId = t3.flatId
		    LEFT JOIN `tbl_society` AS t4 ON t3.societyId = t4.societyId
		    SET t1.otp = FLOOR(RAND() * 9999) 
		    WHERE t1.userType = p_userType AND t2.mobileNumber = p_mobile 
		    AND t1.deleted = 'N' AND t2.deleted = 'N' AND t3.flatNo = p_flatNumber AND t3.deleted = 'N'
		    AND t4.societyUniqueId = p_societyUniqueId AND t4.deleted = 'N';
		    
		    SELECT '200' AS responseCode,'OTP send to your mobile' AS responseMessage,t1.otp,
		    t1.userId,t1.userType,t2.mobileNumber,
		    t3.userType AS userSubType
		    FROM `tbl_users` AS t1
		    LEFT JOIN `tbl_flat_contact_mobile` AS t2 ON t1.linkId = t2.mobileId
		    LEFT JOIN `tbl_flat` AS t3 ON t2.flatId = t3.flatId
		    LEFT JOIN `tbl_society` AS t4 ON t3.societyId = t4.societyId
		    WHERE t1.userType = p_userType AND t2.mobileNumber = p_mobile 
		    AND t1.deleted = 'N' AND t2.deleted = 'N' AND t3.flatNo = p_flatNumber AND t3.deleted = 'N'
		    AND t4.societyUniqueId = p_societyUniqueId AND t4.deleted = 'N';
		ELSE
		    SELECT '0' AS responseCode,'User not exist' AS responseMessage;
		END IF;
		    
	    END IF;
	
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_Other_product_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_Other_product_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_Other_product_iud`(
	p_mode INT (11),
	p_id INT(11),
	p_type VARCHAR(55),
	p_photo VARCHAR(55),
	p_hyperLink VARCHAR(55),
	p_email VARCHAR(55),
	p_mobile VARCHAR(55),
	p_header VARCHAR(55),
	p_detail TEXT,
	p_userId INT(11)
    
    )
BEGIN
	IF p_mode=0
	THEN
	
		INSERT INTO `tbl_oth_photos`(`type`,`photoName`,`hyperlink`,`email`,`phone`,`header`,`details`,`createdBy`)
		VALUES(p_type,p_photo,p_hyperLink,p_email,p_mobile,p_header,p_detail,p_userId);
		SELECT 'sucess' AS color,'Record Created Sucessfully' AS responseMessage;
	END IF;
	
	
	IF p_mode=3
	THEN
		SELECT CASE WHEN `type` = 'ADV'
		THEN
		CONCAT((SELECT `name` FROM `tbl_common_url` WHERE urlType = 'url'),'uploads/othImage/adv/',photoName)
		WHEN
		`type`='OthProd'
		THEN
		CONCAT((SELECT `name` FROM `tbl_common_url` WHERE urlType = 'url'),'uploads/othImage/OthProd/',photoName)
		ELSE
		CONCAT((SELECT `name` FROM `tbl_common_url` WHERE urlType = 'url'),'uploads/othImage/SupPart/',photoName)
		END
		photo
		,photoId,`type`,photoName,hyperlink,email,phone,header,details,deleted FROM `tbl_oth_photos`;
	END IF;
	
	IF p_mode=1
	THEN
		SELECT *,CASE WHEN `type` = 'ADV'
		THEN
		CONCAT((SELECT `name` FROM `tbl_common_url` WHERE urlType = 'url'),'uploads/othImage/adv/',photoName)
		WHEN
		`type`='OthProd'
		THEN
		CONCAT((SELECT `name` FROM `tbl_common_url` WHERE urlType = 'url'),'uploads/othImage/OthProd/',photoName)
		ELSE
		CONCAT((SELECT `name` FROM `tbl_common_url` WHERE urlType = 'url'),'uploads/othImage/SupPart/',photoName)
		END
		photo
		FROM `tbl_oth_photos` WHERE photoId =p_id;
	END IF;
	
	IF p_mode=2
	THEN
		 UPDATE `tbl_oth_photos` 
		 SET
		`type` = p_type , 
		-- `photoName` = ifnull(nullif(p_photo,''),photoName) , 
		`hyperlink` = p_hyperLink , 
		`email` = p_email , 
		`phone` = p_mobile , 
		`header` =p_header , 
		`details` = p_detail , 
		`updatedBy` = p_userId , 
		`updatedDate` =NOW()
		 WHERE
		`photoId` = p_id ;
		IF IFNULL(NULLIF(p_photo,''),'')!=''
		THEN
		 UPDATE `tbl_oth_photos` 
		 SET
		`photoName` = p_photo
		 WHERE
		`photoId` = p_id ;
		END IF;
		
	END IF;
	
	
	
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_otp_verification_app` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_otp_verification_app` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_otp_verification_app`(
    p_userId INT(11),
    p_otp VARCHAR(55),
    p_gcmId VARCHAR(255)
    )
BEGIN
	IF EXISTS(SELECT userId FROM `tbl_users` WHERE userId = p_userId AND otp = p_otp AND deleted = 'N')
	THEN
	    
	     UPDATE `tbl_users` SET gcmId=p_gcmId WHERE userId=p_userId;
	    SELECT '200' AS responseCode,'User login Successfully' AS responseMessage,
	    t1.userId,t1.userType,t1.password,t1.profileImage,t1.gcmId,t2.mobileNumber,
	    t3.flatNo,t3.flatId,t3.userType AS userSubType,t4.societyId,t4.societyUniqueId,t4.societyName,t4.address
	    FROM `tbl_users` AS t1
	    LEFT JOIN `tbl_flat_contact_mobile` AS t2 ON t1.linkId = t2.mobileId
	    LEFT JOIN `tbl_flat` AS t3 ON t2.flatId = t3.flatId
	    LEFT JOIN `tbl_society` AS t4 ON t3.societyId = t4.societyId
	    WHERE t1.userId = p_userId
	    AND t1.deleted = 'N' AND t2.deleted = 'N' AND t3.deleted = 'N' AND t4.deleted = 'N';
	ELSE
	    SELECT '0' AS responseCode,'Wrong OTP' AS responseMessage;
	END IF;
		    
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_poll_creation_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_poll_creation_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_poll_creation_iud`(
	P_mode INT (11),
	p_society INT(11),
	p_pollName VARCHAR(255),
	p_validFrom VARCHAR(255),
	p_validTill VARCHAR(255),
	p_question VARCHAR(255),
	p_option VARCHAR(255),
	p_optionHidden VARCHAR(255),
	p_userId INT(11),
	p_societyId INT(11)
    
    )
BEGIN
	IF p_mode=0
	THEN
	IF EXISTS(SELECT pollId FROM `tbl_polls` WHERE societyId=p_society AND validTillDate=DATE_FORMAT(STR_TO_DATE(p_validTill,'%d-%m-%Y'),'%Y-%m-%d')  AND deleted='N')
	THEN
		SELECT 'danger' AS color,'Poll already exists in this till validity.' AS responseMessage;
	ELSE
		INSERT INTO `tbl_polls`(societyId,pollName,validFromDate,validTillDate,createdBy)
		VALUES(p_society,p_pollName,DATE_FORMAT(STR_TO_DATE(p_validFrom,'%d-%m-%Y'),'%Y-%m-%d'),
		DATE_FORMAT(STR_TO_DATE(p_validTill,'%d-%m-%Y'),'%Y-%m-%d'),p_userId);
		
		INSERT INTO `tbl_polls_questions` (pollId,questionName,createdBy)
		VALUES((SELECT MAX(pollId) FROM `tbl_polls` WHERE deleted = 'N' AND societyId=p_society),p_question,p_userId);
		
		INSERT INTO `tbl_polls_options`(pollId,questionId,optionName,createdBy)
		SELECT a.pollId,a.questionId,a.optionName,a.userId FROM(SELECT (SELECT MAX(pollId) FROM `tbl_polls` WHERE deleted = 'N' AND societyId=p_society)pollId,
		(SELECT MAX(questionId) FROM `tbl_polls_questions` WHERE deleted = 'N' 
		AND pollId=(SELECT MAX(pollId) FROM `tbl_polls` WHERE deleted = 'N' AND societyId=p_society))questionId,
		TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_option, ',', n.n), ',', -1))optionName,p_userId AS userId,
		TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_optionHidden, ',', n.n), ',', -1))hiden
		FROM
		(    
		SELECT a.N + b.N * 10 + 1 n
		FROM
		(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
		,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
		ORDER BY n
		) n
		WHERE n.n <= 1 + (LENGTH(p_optionHidden) - LENGTH(REPLACE(p_optionHidden , ',', '')))
		AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_optionHidden, ',', n.n), ',', -1)))a;
		SELECT 'success' AS color,'Poll created successfully' AS responseMessage;
	END IF;
	
	END IF;
	
	IF p_mode=3
	THEN
		SELECT pollId,pollName,
		(SELECT societyName FROM `tbl_society` WHERE deleted='N' AND societyId=tbl_polls.societyId)societyName,
		DATE_FORMAT(validFromDate,'%d %b,%Y')validFromDate,DATE_FORMAT(validTillDate,'%d %b,%Y')validTillDate,
		(SELECT questionName FROM `tbl_polls_questions` WHERE deleted='N' AND pollId=tbl_polls.pollId)questionName 
		FROM `tbl_polls`  WHERE deleted='N' AND societyId=IFNULL(NULLIF(p_societyId,''),societyId);
	END IF;
	
	
	
	
	
	
    END */$$
DELIMITER ;

