/* Procedure structure for procedure `proc_residence_gallery_image_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_residence_gallery_image_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_residence_gallery_image_iud`(
    p_mode tinyint,
    p_societyId int, 
    p_galleryId VARCHAR(255),
    p_galleryPhotoId varchar(11),
    p_userId int
/*
CALL proc_residence_gallery_image_iud(3,1,12,NULL,1)
CALL proc_residence_gallery_image_iud(2,1,12,11,1)*/    
    )
BEGIN 
if p_mode=2
then
if not exists(select * from tbl_gallery_photos where galleryPhotoId=p_galleryPhotoId
AND galleryId=p_galleryId
AND userId=p_userId)
then SELECT '0' responseCode, 'User not allowed to delete!' responseMessage;
else
update tbl_gallery_photos
set deleted='Y'
WHERE galleryPhotoId=p_galleryPhotoId
and galleryId=p_galleryId
and userId=p_userId;
SELECT '200' responseCode, 'Image deleted successfully!' responseMessage;
end if;    
END IF;    
IF p_mode=3
THEN
select xx.societyId,xx.galleryId,xx.galleryName,xx.validTillDate,xx.galleryPhotoId,xx.userId,
xx.photo,xx.`timestamp`,
(SELECT z.timestampCount FROM 
(SELECT COUNT(`timestamp`)`timestampCount`,`timestamp` FROM
(SELECT 
CASE WHEN DATE(NOW())=DATE(b.createdDate)AND TIME_TO_SEC(TIMEDIFF(NOW(),b.createdDate))/60<1
THEN 'Recent' 
WHEN DATE(NOW())=DATE(b.createdDate)AND TIME_TO_SEC(TIMEDIFF(NOW(),b.createdDate))/60>1
THEN 'Today' 
WHEN DATEDIFF(NOW(),b.createdDate)=1
THEN 'Yesterday'
ELSE CONCAT(DATEDIFF(NOW(),b.createdDate),' day ago') END `timestamp`
FROM tbl_gallery a,tbl_gallery_photos b
WHERE a.galleryId=p_galleryId
and a.galleryId=b.galleryId
AND a.deleted=b.deleted
AND a.deleted='N')a
GROUP BY `timestamp`)z
WHERE z.`timestamp`=xx.`timestamp`)timestampCount
from
(select a.societyId,a.galleryId,a.galleryName,a.validTillDate,
b.galleryPhotoId,b.userId,
CONCAT((SELECT `name` FROM `tbl_common_url` WHERE `urlType`='url')
         ,'uploads/galleryUserPhoto/',b.photo)photo,
CASE WHEN DATE(NOW())=DATE(b.createdDate)AND TIME_TO_SEC(TIMEDIFF(NOW(),b.createdDate))/60<1
THEN 'Recent' 
WHEN DATE(NOW())=DATE(b.createdDate)AND TIME_TO_SEC(TIMEDIFF(NOW(),b.createdDate))/60>1
THEN 'Today' 
WHEN DATEDIFF(NOW(),b.createdDate)=1
THEN 'Yesterday'
ELSE CONCAT(DATEDIFF(NOW(),b.createdDate),' day ago') END `timestamp`
from tbl_gallery a,tbl_gallery_photos b
WHERE a.galleryId=p_galleryId
AND a.galleryId=b.galleryId
AND a.deleted=b.deleted
and a.deleted='N'
order by b.createdDate desc)xx;
END IF;
-- for Advertisement images
IF p_mode=11
THEN
SELECT a.photoId,
CONCAT((SELECT `name` FROM `tbl_common_url` WHERE `urlType`='url')
         ,'uploads/othImage/adv/',a.photoName)photo,
         a.hyperlink,a.email,a.phone,a.header,a.details,
         a.createdBy userId
FROM tbl_oth_photos a
where a.deleted='N'
AND `type`='ADV'
ORDER BY a.createdDate DESC;
END IF;
-- for Other Product images
IF p_mode=12
THEN
SELECT a.photoId,
CONCAT((SELECT `name` FROM `tbl_common_url` WHERE `urlType`='url')
         ,'uploads/othImage/OthProd/',a.photoName)photo,
         a.hyperlink,a.email,a.phone,a.header,a.details,
         a.createdBy userId
FROM tbl_oth_photos a
WHERE a.deleted='N'
AND `type`='OthProd'
ORDER BY a.createdDate DESC;
END IF;
-- for Support Partner images
IF p_mode=13
THEN
SELECT a.photoId,
CONCAT((SELECT `name` FROM `tbl_common_url` WHERE `urlType`='url')
         ,'uploads/othImage/SupPart/',a.photoName)photo,
         a.hyperlink,a.email,a.phone,a.header,a.details,
         a.createdBy userId
FROM tbl_oth_photos a
WHERE a.deleted='N'
AND `type`='SupPart'
ORDER BY a.createdDate DESC;
END IF;
    
    END */$$
DELIMITER ;

