/* Procedure structure for procedure `proc_residence_notice_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_residence_notice_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_residence_notice_iud`(
	P_mode INT (11),
	p_societyId INT(11),
	p_userId INT(11),
	p_description TEXT,
	p_type VARCHAR(255),
	p_image VARCHAR(255),
	p_vedio VARCHAR(255),
	p_validTill VARCHAR(255),
	p_noticeId INT(11)
    
    )
BEGIN
	IF p_mode=0
	THEN
		INSERT INTO tbl_notice(societyId,description,`type`,image,vedio,validTill,createdBy)
		VALUES
		(p_societyId,p_description,p_type,p_image,p_vedio,p_validTill,p_userId);
		
		-- SELECT '200' AS responseCode,'Notice added sucessfully' AS responseMessage;
		
		SELECT '' AS `status`,noticeId,description,DATE_FORMAT(validTill,'%b %d,%Y') AS validTill,`type`,
		(SELECT CONCAT(`name`,'uploads/noticeVedio/',vedio) FROM `tbl_common_url` WHERE urlType ='url') AS vedio,
		(SELECT CONCAT(`name`,'uploads/noticeImage/',image) FROM `tbl_common_url` WHERE urlType ='url') AS image
		FROM `tbl_notice` WHERE societyId = p_societyId AND deleted = 'N' AND (validTill>=DATE(NOW()) OR IFNULL(NULLIF(validTill,''),'')='') ORDER BY validTill,createdDate DESC;
	
	END IF;
	
	if p_mode = 1
	then
		SELECT '' AS `status`,noticeId,description,DATE_FORMAT(validTill,'%b %d,%Y') AS validTill,`type`,
		(SELECT CONCAT(`name`,'uploads/noticeVedio/',vedio) FROM `tbl_common_url` WHERE urlType ='url') AS vedio,
		(SELECT CONCAT(`name`,'uploads/noticeImage/',image) FROM `tbl_common_url` WHERE urlType ='url') AS image
		FROM `tbl_notice` WHERE societyId = p_societyId AND deleted = 'N' AND (validTill>=DATE(NOW()) OR IFNULL(NULLIF(validTill,'0'),'')='');
	end if;
	
	IF p_mode = 2
	THEN
		UPDATE `tbl_notice` SET deleted = 'Y' WHERE noticeId=p_noticeId AND societyId=p_societyId;
		SELECT '200' AS responseCode,'Notice deleted sucessfully' AS responseMessage;
	END IF;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_residence_olx_product_list` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_residence_olx_product_list` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_residence_olx_product_list`(
    p_societyId INT(11),
    p_userId INT(11),
    p_societyOlxId INT (11)
    )
BEGIN
	IF p_societyOlxId = ''
	THEN
		SELECT t1.societyOlxId,t1.productName,t1.productDesc,
		(SELECT CONCAT(`name`,'uploads/residenceOlxPhoto/',t1.productImage) FROM `tbl_common_url` WHERE urlType = 'url')
		AS productImage,t1.validTillDate,t2.mobileNumber,t3.flatNo,
		CASE WHEN t1.userId=p_userId
		THEN 
		'Y'
		ELSE
		'N'
		END 
		myProduct FROM `tbl_society_olx` AS t1 
		LEFT JOIN `tbl_users` AS t4 ON t1.userId=t4.userId AND t4.deleted = 'N'
		LEFT JOIN `tbl_flat_contact_mobile` AS t2 ON t4.linkId = t2.mobileId AND t2.deleted = 'N'
		LEFT JOIN `tbl_flat` AS t3 ON t2.flatId = t3.flatId AND t3.deleted = 'N'
		WHERE t1.deleted ='N'  AND t1.societyId=p_societyId 
		AND t1.userId = p_userId AND validTillDate >=DATE(NOW());
	ELSE
		SELECT '200' AS responseCode,'Society olx product detail fetched successfully' AS responseMessage,
		t1.societyOlxId,t1.productName,t1.productDesc,
		(SELECT CONCAT(`name`,'uploads/residenceOlxPhoto/',t1.productImage) FROM `tbl_common_url` WHERE urlType = 'url'
		) AS productImage,
		t1.validTillDate,t2.mobileNumber,t3.flatNo
		FROM `tbl_society_olx` AS t1 
		LEFT JOIN `tbl_flat_contact_mobile` AS t2 ON t1.userId = t2.mobileId
		LEFT JOIN `tbl_flat` AS t3 ON t2.flatId = t3.flatId
		WHERE t1.deleted ='N' AND t1.societyId = p_societyId  AND societyOlxId = p_societyOlxId;
	END IF;
	
	
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_residence_poll_ques_opt_tran_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_residence_poll_ques_opt_tran_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_residence_poll_ques_opt_tran_iud`(
    p_mode tinyint,
    p_societyId int, 
    p_pollId int,
    p_questionId int,
    p_optionId int,
    p_userId int
/*
CALL proc_residence_poll_ques_opt_tran_iud(0,1,1,1,1,1)
CALL proc_residence_poll_ques_opt_tran_iud(4,1,null,null,null,1)
*/    
    )
BEGIN 
if p_mode=0
then
if EXISTS(select * from tbl_polls_trans where pollId=p_pollId and userId=p_userId)
then
SELECT '0' responseCode, 'Poll already completed by user!' responseMessage;
else
insert into tbl_polls_trans(userId,pollId,questionId,optionId,createdBy)
select p_userId,p_pollId,p_questionId,p_optionId,p_userId;
SELECT '200' responseCode, 'Poll submitted successfully!' responseMessage;
end if;    
END IF;    
-- to fetch poll, quesion & answer
IF p_mode=4
THEN
if exists(SELECT DISTINCT b.questionName
FROM tbl_polls a, tbl_polls_questions b
WHERE a.pollId=b.pollId	AND a.deleted=b.deleted	AND b.deleted='N' AND a.societyId=p_societyId
AND DATE(NOW()) BETWEEN validFromDate AND validTillDate
)
then
	SELECT DISTINCT '200' responseCode, 'Poll fethed successfully!' responseMessage,
			a.pollId,a.societyId,a.pollName,b.questionId,b.questionName
			FROM tbl_polls a, tbl_polls_questions b
			WHERE a.pollId=b.pollId
			AND a.deleted=b.deleted
