a.pollId,a.societyId,a.pollName,b.questionId,b.questionName
from tbl_polls a, tbl_polls_questions b
where a.pollId=b.pollId
and a.deleted=b.deleted
and b.deleted='N'
AND a.societyId=p_societyId
and date(now()) between validFromDate and validTillDate;*/
END IF;    
    END */$$
