/* Procedure structure for procedure `proc_society_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_society_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_society_iud`(
	P_mode INT (11),
	p_image VARCHAR(255),
	p_societyUniqueId VARCHAR(55),
	p_societyName VARCHAR(55),
	p_societyAddress VARCHAR(55),
	p_name VARCHAR(55),
	p_designation VARCHAR(55),
	p_phone VARCHAR(55),
	p_email VARCHAR(55),
	p_userId INT (11)
    
    )
BEGIN
	IF p_mode=0
	THEN
	INSERT INTO tbl_society (societyUniqueId,societyName,address,createdBy,societyImage)
	VALUES
	(p_societyUniqueId,p_societyName,p_societyAddress,p_userId,p_image);
	
	
	
	INSERT INTO tbl_society_contact
	(societyId,`name`,designation,phone,email,createdBy)
	   SELECT 
	   (SELECT MAX(societyId) FROM `tbl_society`),
	   TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_name, ',', n.n), ',', -1)),
	   TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_designation, ',', n.n), ',', -1)),
	   TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_phone, ',', n.n), ',', -1)),
	  TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_email, ',', n.n), ',', -1)),p_userId
	    FROM
	    (    
	   SELECT a.N + b.N * 10 + 1 n
	    FROM
	   (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	  ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	   ORDER BY n
	) n
	WHERE n.n <= 1 + (LENGTH(p_phone) - LENGTH(REPLACE(p_phone, ',', '')))
	AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_phone, ',', n.n), ',', -1));	
	
	SELECT 'Society data inserted successfully.!!' AS responseMessage,'success' AS color;
	END IF;
	/*	
	END IF;
	
	IF p_mode=3
	THEN
	   SELECT * FROM `tbl_flat_detail` WHERE deleted='N';
	END IF;
	
	IF p_mode=1
	THEN
	UPDATE `tbl_flat_detail` SET
	flatNo=p_flatNo,
	ownerName=p_ownerName,mobile=p_mobile,email=p_email,occupation=p_occupation,ownerType=p_ownerType,
	avalabilty=p_avalabilty,lesseeName=p_lesseeName,tenantMobile=p_tenantMobile,tenantEmail=p_tenantEmail,
	tenantOccupation=p_tenantoccupation,
	lastPaymentPeriod=p_lastPaymentPeriod,paymentDate=p_paymentDate,paymentMode=p_paymentMode
	WHERE flatId= p_flatId;*/
	
	
	IF p_mode=3
	THEN
	   SELECT societyId,societyUniqueId,societyName,address,deleted,DATE_FORMAT(createdDate,'%d-%m-%y')createdDate,
	   CASE WHEN 
	   (SELECT COUNT(societyId) FROM `tbl_flat` WHERE tbl_flat.societyId=tbl_society.societyId AND deleted='N')+
	   (SELECT COUNT(societyId) FROM `tbl_user_vendor_society_mapping` WHERE tbl_user_vendor_society_mapping.societyId=tbl_society.societyId AND deleted='N')+
	   (SELECT COUNT(societyId) FROM `tbl_user_vendor_society_offers_mapping` WHERE tbl_user_vendor_society_offers_mapping.societyId=tbl_society.societyId AND deleted='N')+
	   (SELECT COUNT(societyId) FROM `tbl_housekeeping_staff_flat_mapping` WHERE tbl_housekeeping_staff_flat_mapping.societyId=tbl_society.societyId AND deleted='N')+
	   (SELECT COUNT(societyId) FROM `tbl_support_staff_society_mapping` WHERE tbl_support_staff_society_mapping.societyId=tbl_society.societyId AND deleted='N')+
	   (SELECT COUNT(societyId) FROM `tbl_gallery` WHERE tbl_gallery.societyId=tbl_society.societyId AND deleted='N')+
	   (SELECT COUNT(societyId) FROM `tbl_polls` WHERE tbl_polls.societyId=tbl_society.societyId AND deleted='N')+
	   (SELECT COUNT(societyId) FROM  `tbl_complaints` WHERE tbl_complaints.societyId=tbl_society.societyId AND deleted='N')= 0
	   THEN
	   'N'
	   ELSE
	   'Y'
	   END
	   `status` FROM `tbl_society`;
	   
	END IF;
	
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_support_staff_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_support_staff_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_support_staff_iud`(
	P_mode INT (11),
	p_supportStaffId INT(11),
	p_name VARCHAR(55),
	p_mobile VARCHAR(55),
	p_aadhar VARCHAR(55),
	p_photo VARCHAR(55),
	p_supportStaffCategory VARCHAR(55),
	p_society VARCHAR(55),
	p_userId VARCHAR(55)
    )
BEGIN
	IF p_mode=0
	THEN
	
	INSERT INTO `tbl_support_staff` 
	(`name`,mobile,aadhar,photo,createdBy)
	VALUES
	(p_name,p_mobile,p_aadhar,p_photo,p_userId);
	
	INSERT INTO `tbl_support_staff_society_mapping` (supportStaffId,societyId,createdBy)
	   SELECT * FROM(SELECT (SELECT MAX(supportStaffId) FROM `tbl_support_staff` WHERE deleted='N') AS supportStaffId,
	   TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_society, ',', n.n), ',', -1))AS societyId,p_userId AS userId
	    FROM
	    (    
	   SELECT a.N + b.N * 10 + 1 n
	    FROM
	   (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	  ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	   ORDER BY n
	) n
	WHERE n.n <= 1 + (LENGTH(p_society) - LENGTH(REPLACE(p_society, ',', '')))
	AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_society, ',', n.n), ',', -1)))a WHERE a.societyId NOT IN 
	(SELECT societyId FROM tbl_support_staff_society_mapping WHERE societyId=a.societyId AND supportStaffId=a.supportStaffId AND deleted='N');
	
	INSERT INTO `tbl_support_staff_occupation_mapping` (supportStaffId,occupationId,createdBy)
	   SELECT * FROM(SELECT (SELECT MAX(supportStaffId) FROM `tbl_support_staff` WHERE deleted='N') AS supportStaffId,
	   TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_supportStaffCategory, ',', n.n), ',', -1))AS occupationId,p_userId AS userId
	    FROM
	    (    
	   SELECT a.N + b.N * 10 + 1 n
	    FROM
	   (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	  ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	   ORDER BY n
	) n
	WHERE n.n <= 1 + (LENGTH(p_supportStaffCategory) - LENGTH(REPLACE(p_supportStaffCategory, ',', '')))
	AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_supportStaffCategory, ',', n.n), ',', -1)))a WHERE a.occupationId NOT IN 
	(SELECT occupationId FROM `tbl_support_staff_occupation_mapping` WHERE occupationId=a.occupationId AND supportStaffId=a.supportStaffId AND deleted='N');
	
	SELECT 'Support staff created successfully' AS responseMessage,'success' AS color;
	END IF;
	
	IF p_mode=3
	THEN
	SELECT * FROM `tbl_support_staff`;
	END IF;
	
	IF p_mode=2
	THEN
	 UPDATE `tbl_support_staff` SET `name`=p_name,mobile=p_mobile,aadhar=p_aadhar,updatedBy=p_userId,updatedDate=NOW()
	 WHERE supportStaffId=p_supportStaffId;
	 IF p_photo !=''
	 THEN
	 UPDATE `tbl_support_staff` SET photo=p_photo
	 WHERE supportStaffId=p_supportStaffId;
	 END IF;
	
	DROP  TABLE IF EXISTS `tmp_support_staff_occupation`; 
	CREATE   TABLE tmp_support_staff_occupation
	   (
	   supportStaffId VARCHAR(250),
	   occupationId VARCHAR(250),
	   createdBy VARCHAR(250)
	   );
	   INSERT INTO `tmp_support_staff_occupation` (supportStaffId,occupationId,createdBy)
	    SELECT * FROM(SELECT p_supportStaffId AS supportStaffId,
	   TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_supportStaffCategory, ',', n.n), ',', -1))AS occupationId,p_userId AS userId
	    FROM
	    (    
	   SELECT a.N + b.N * 10 + 1 n
	    FROM
	   (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	  ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	   ORDER BY n
	) n
	WHERE n.n <= 1 + (LENGTH(p_supportStaffCategory) - LENGTH(REPLACE(p_supportStaffCategory, ',', '')))
	AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_supportStaffCategory, ',', n.n), ',', -1)))a;
	  
	  INSERT INTO tbl_support_staff_occupation_mapping (supportStaffId,occupationId,createdBy)
	SELECT * FROM tmp_support_staff_occupation WHERE tmp_support_staff_occupation.occupationId NOT IN 
	(SELECT occupationId FROM `tbl_support_staff_occupation_mapping` WHERE occupationId=tmp_support_staff_occupation.occupationId 
	AND supportStaffId=tmp_support_staff_occupation.supportStaffId );
	
	UPDATE `tbl_support_staff_occupation_mapping`
	SET deleted='Y'
	WHERE occupationId NOT IN (SELECT occupationId FROM tmp_support_staff_occupation 
	WHERE tmp_support_staff_occupation.occupationId=tbl_support_staff_occupation_mapping.occupationId)
	 AND supportStaffId=p_supportStaffId;
	 
	 UPDATE 
	tbl_support_staff_occupation_mapping
	SET deleted='N'
	WHERE occupationId IN (SELECT occupationId FROM tmp_support_staff_occupation 
	WHERE tmp_support_staff_occupation.occupationId=tbl_support_staff_occupation_mapping.occupationId)
	 AND supportStaffId=p_supportStaffId AND deleted='Y';
	 
	 DROP  TABLE IF EXISTS `tmp_support_staff_society`; 
	CREATE   TABLE tmp_support_staff_society
	   (
	   supportStaffId VARCHAR(250),
	   societyId VARCHAR(250),
	   createdBy VARCHAR(250)
	   );
	   INSERT INTO `tmp_support_staff_society` (supportStaffId,societyId,createdBy)
	    SELECT * FROM(SELECT p_supportStaffId AS supportStaffId,
	   TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_society, ',', n.n), ',', -1))AS societyId,p_userId AS userId
	    FROM
	    (    
	   SELECT a.N + b.N * 10 + 1 n
	    FROM
	   (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	  ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	   ORDER BY n
	) n
	WHERE n.n <= 1 + (LENGTH(p_society) - LENGTH(REPLACE(p_society, ',', '')))
	AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_society, ',', n.n), ',', -1)))a;
	  
	  INSERT INTO tbl_support_staff_society_mapping (supportStaffId,societyId,createdBy)
	SELECT * FROM tmp_support_staff_society WHERE tmp_support_staff_society.societyId NOT IN 
	(SELECT societyId FROM `tbl_support_staff_society_mapping` 
	WHERE tbl_support_staff_society_mapping.societyId=tmp_support_staff_society.societyId 
	AND supportStaffId=tmp_support_staff_society.supportStaffId );
	
	UPDATE `tbl_support_staff_society_mapping`
	SET deleted='Y'
	WHERE societyId NOT IN (SELECT societyId FROM tmp_support_staff_society 
	WHERE tmp_support_staff_society.societyId=tbl_support_staff_society_mapping.societyId)
	 AND supportStaffId=p_supportStaffId;
	 
	 UPDATE 
	tbl_support_staff_society_mapping
	SET deleted='N'
	WHERE societyId IN (SELECT societyId FROM tmp_support_staff_society 
	WHERE tmp_support_staff_society.societyId=tbl_support_staff_society_mapping.societyId)
	 AND supportStaffId=p_supportStaffId AND deleted='Y';
	
	SELECT 'Support staff detail updated successfully' AS responseMessage,'success' AS color;
	
	
	END IF;
	
	
	
    END */$$
DELIMITER ;

