/* Procedure structure for procedure `proc_type_master_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_type_master_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_type_master_iud`(
   p_mode TINYINT,
   p_typeMasterName VARCHAR(50),
   p_typeMasterType VARCHAR(50),
   p_userId INT
   )
BEGIN
   IF p_mode = 0
   THEN
   IF NOT EXISTS( SELECT * FROM `tbl_type_master` WHERE typeMasterName=p_typeMasterName AND typeMasterType=p_typeMasterType AND deleted='N' )
   THEN
   INSERT INTO tbl_type_master (typeMasterName,typeMasterType,createdBy,createdDate)
   VALUES (p_typeMasterName,p_typeMasterType,p_userId,NOW());
   SELECT 'Record inserted successfully' AS responseMessage,'success' AS color;
   ELSE
   SELECT 'This record is already exists' AS responseMessage,'danger' AS color;
   END IF;
   END IF;
   
  
   IF p_mode = 3
   THEN
	SELECT typeMasterName,typeMasterId,typeMasterType,
	CASE WHEN typeMasterType=1 AND	((SELECT COUNT(*) FROM `tbl_vendor_category` WHERE categoryId=typeMasterId AND deleted='N')= 0)
	THEN
	'N'
	WHEN typeMasterType=2 AND ((SELECT COUNT(*) FROM `tbl_housekeeping_staff` WHERE categoryId=typeMasterId AND deleted='N')= 0)
	THEN
	'N'
	ELSE
	'Y'
	END
	`status`,
	(SELECT realTypeName FROM tbl_type WHERE typeId=typeMasterType) AS `type`
	 FROM tbl_type_master WHERE deleted='N';
   END IF;
   END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_unique_flat` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_unique_flat` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_unique_flat`(
p_type VARCHAR(55)
)
BEGIN
    DECLARE random_flat VARCHAR(55);
    IF p_type='flat'
    THEN
    SET random_flat = (SELECT CONCAT(SUBSTR(MONTHNAME(NOW()),1,1),FLOOR(RAND() * 9999)) AS flatNo);
    IF random_flat=(SELECT flatNo FROM `tbl_flat` WHERE flatId=(SELECT MAX(flatId) FROM `tbl_flat`))
    THEN
    SET random_flat = (SELECT CONCAT(SUBSTR(MONTHNAME(NOW()),1,1),FLOOR(RAND() * 9999)) AS flatNo);
    SELECT random_flat;
    ELSE
    SELECT random_flat;
    END IF;
    END IF;
    
    IF p_type='society'
    THEN
    SET random_flat =(SELECT CONCAT('S',IFNULL(RIGHT(CONCAT('0000',MAX(SUBSTR(societyUniqueId,2))+1),5),'00001')) 
    FROM `tbl_society` WHERE LEFT(societyUniqueId,1) = 'S');
    SELECT random_flat;
    END IF;
    
    IF p_type='vendor'
    THEN
    SET random_flat =(SELECT CONCAT('V',IFNULL(RIGHT(CONCAT('00000',MAX(SUBSTR(vendorUniqueId,2))+1),6),'000001')) 
    FROM `tbl_vendor` WHERE LEFT(vendorUniqueId,1) = 'V');
     SELECT random_flat;
    END IF;
    
    IF p_type='superAdmin'
    THEN
    SET random_flat =(SELECT CONCAT('R',IFNULL(RIGHT(CONCAT('0000',MAX(SUBSTR(adminUniqueId,2))+1),6),'00001')) 
    FROM `tbl_admins` WHERE LEFT(adminUniqueId,1) = 'R');
     SELECT random_flat;
    END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_update_vendor_app` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_update_vendor_app` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_update_vendor_app`(
    p_userId INT(11),   
    p_vendorName VARCHAR(55), 
    p_mobile VARCHAR(55),    
    p_shopName VARCHAR(55),    
    p_openingTime VARCHAR(55),    
    p_closingTime VARCHAR(55),
    p_imageUrl VARCHAR(255),
    p_profileImage VARCHAR(55),
    p_address varchar(255),
    p_dayName varchar(55)   
    )
BEGIN
	UPDATE `tbl_vendor` 
	SET 
	vendorName = p_vendorName , mobile = p_mobile , shopName = p_shopName , 
	openingTime = p_openingTime , closingTime = p_closingTime , address=p_address,
	updatedBy = (SELECT linkId FROM tbl_users WHERE userId=p_userId) , updatedDate = NOW() 
	WHERE vendorId = (SELECT linkId FROM tbl_users WHERE userId=p_userId) ;
	
	UPDATE `tbl_users` SET profileImage=IFNULL(NULLIF(p_profileImage,''),profileImage) 
