	SUBSTRING_INDEX(SUBSTRING_INDEX(p_dayName, ',', numbers.n), ',', -1),
		p_userId		
	FROM numbers; 	
	SELECT '200' AS responseCode,'Details updated successfully' AS responseMessage;
	
	
	
    END */$$
