/* Procedure structure for procedure `proc_vendor_category_mapping` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_vendor_category_mapping` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_vendor_category_mapping`(
   p_mode TINYINT,
   p_vendor VARCHAR(50),
   p_category VARCHAR(50),
   p_userId INT
   )
BEGIN
   IF p_mode = 0
   THEN
   INSERT INTO `tbl_vendor_category` (vendorId,categoryId,createdBy)
	   SELECT * FROM(SELECT p_vendor AS vendorId,
	   TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_category, ',', n.n), ',', -1))AS categoryId,p_userId AS userId
	    FROM
	    (    
	   SELECT a.N + b.N * 10 + 1 n
	    FROM
	   (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	  ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	   ORDER BY n
	) n
	WHERE n.n <= 1 + (LENGTH(p_category) - LENGTH(REPLACE(p_category, ',', '')))
	AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_category, ',', n.n), ',', -1)))a WHERE a.vendorId NOT IN 
	(SELECT vendorId FROM tbl_vendor_category WHERE vendorId=a.vendorId AND categoryId=a.categoryId AND deleted='N');
	SELECT 'Vendor Category Mapping inserted Successfully.' AS responseMessage,'success' AS color;
   END IF;
   
   IF p_mode = 3
   THEN
	SELECT t1.vendorId,t1.vendorCategoryId,t2.typeMasterName,t3.vendorName FROM `tbl_vendor_category`t1
	LEFT JOIN `tbl_type_master` t2 ON t1.categoryId=t2.typeMasterId
	LEFT JOIN `tbl_vendor` t3 ON t1.vendorId=t3.vendorId 
	WHERE t1.vendorId=p_vendor AND t1.deleted='N';
   END IF;
   
   IF p_mode = 1
   THEN
	 DROP  TEMPORARY TABLE IF EXISTS `tmp_vendor_category`; 
	CREATE  TEMPORARY TABLE tmp_vendor_category
	   (
	   vendorId VARCHAR(250),
	   categoryId VARCHAR(250),
	   createdBy VARCHAR(250)
	   
	   );
	INSERT INTO `tmp_vendor_category` (vendorId,categoryId,createdBy)
	SELECT * FROM(SELECT p_vendor AS vendorId,
	   TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_category, ',', n.n), ',', -1))AS categoryId,p_userId AS userId
	    FROM
	    (    
	   SELECT a.N + b.N * 10 + 1 n
	    FROM
	   (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
	  ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
	   ORDER BY n
	) n
	WHERE n.n <= 1 + (LENGTH(p_category) - LENGTH(REPLACE(p_category, ',', '')))
	AND TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_category, ',', n.n), ',', -1)))a;
	
	INSERT INTO tbl_vendor_category (vendorId,categoryId,createdBy)
	SELECT * FROM tmp_vendor_category WHERE tmp_vendor_category.vendorId NOT IN 
	(SELECT vendorId FROM tbl_vendor_category WHERE vendorId=tmp_vendor_category.vendorId 
	AND categoryId=tmp_vendor_category.categoryId );
	
	UPDATE tbl_vendor_category
	SET deleted='Y',updatedBy = p_userId,updatedDate = NOW()
	WHERE categoryId NOT IN (SELECT categoryId FROM tmp_vendor_category WHERE tmp_vendor_category.vendorId=tbl_vendor_category.vendorId)
	 AND vendorId=p_vendor;
	 
	 UPDATE 
	`tbl_vendor_category`
	SET deleted='N',updatedBy = p_userId,updatedDate = NOW()
	WHERE categoryId IN (SELECT categoryId FROM tmp_vendor_category WHERE tmp_vendor_category.vendorId=tbl_vendor_category.vendorId)
	 AND vendorId=p_vendor AND deleted='Y';
	 
	SELECT 'Vendor Category Mapping updated Successfully.' AS responseMessage,'success' AS color;
   END IF;
   END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_vendor_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_vendor_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_vendor_iud`(
	P_mode INT (11),
	P_vendor INT(11),
	p_vendorUniqueId VARCHAR(55),
	p_vendorName VARCHAR(55),
	p_mobile VARCHAR(55),
	p_shopName VARCHAR(55),
	p_openingTime VARCHAR(55),
	p_closingTime VARCHAR(55),
	p_panNo VARCHAR(55),
	p_gstNo VARCHAR(55),
	p_tinNo VARCHAR(55),
	p_branchName VARCHAR(55),
	p_bankName VARCHAR(55),
	p_bankNo VARCHAR(55),
	p_paymentMode TEXT,
	p_password INT(11),
	p_userId INT(11)
	
/*
delete
call proc_vendor_iud (4,1,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
*/	
    
    )
BEGIN
	IF p_mode=0
	THEN
	
	INSERT INTO tbl_vendor 
	(vendorUniqueId,vendorName,mobile,shopName,openingTime,closingTime,panNo,
	gstNo,tinNo,branchName,bankName,bankNo,createdBy,paymentMode
	)
	VALUES
	(p_vendorUniqueId,p_vendorName,p_mobile,p_shopName,p_openingTime,p_closingTime,p_panNo,
	p_gstNo,p_tinNo,p_branchName,p_bankName,p_bankNo,p_userId,p_paymentMode
	);
	
	INSERT INTO `tbl_users`(userType,`password`,linkId,createdBy)
	VALUES('vendor',p_password,(SELECT MAX(vendorId)FROM `tbl_vendor` WHERE deleted='N'),p_userId);
	
	SELECT MAX(vendorId)AS vendorId,vendorUniqueId,(SELECT `password` FROM `tbl_users` WHERE userId=(SELECT MAX(userId)FROM `tbl_users` 
	WHERE deleted='N') AND userType = 'vendor')AS `password` FROM tbl_vendor WHERE vendorId=(SELECT MAX(vendorId) FROM tbl_vendor);
	
	
	END IF;
	
	
	IF p_mode=3
	THEN
	SELECT *,
	CASE WHEN
	(SELECT COUNT(*) FROM `tbl_vendor_category` WHERE vendorId=tbl_vendor.vendorId AND deleted='N')+
	(SELECT COUNT(vendorUserId) FROM `tbl_user_vendor_society_mapping` WHERE vendorUserId=
	(SELECT userId FROM tbl_users WHERE linkId=tbl_vendor.vendorId AND userType='vendor' AND deleted='N') AND deleted='N')+
	(SELECT COUNT(vendorUserId) FROM `tbl_user_vendor_offers` WHERE vendorUserId=
	(SELECT userId FROM tbl_users WHERE linkId=tbl_vendor.vendorId AND userType='vendor' AND deleted='N') AND deleted='N')= 0
	THEN
	'N'
	ELSE
	'Y'
	END
	`status`
	FROM tbl_vendor;
	END IF;
	
	IF p_mode=2
	THEN
	
	UPDATE tbl_vendor
	SET
	vendorUniqueId=p_vendorUniqueId,
	vendorName=p_vendorName,
	mobile=p_mobile,
	shopName=p_shopName,
	openingTime=p_openingTime,
	closingTime=p_closingTime,
	panNo=p_panNo,gstNo=p_gstNo,
	tinNo=p_tinNo,
	branchName=p_branchName,
	bankName=p_bankName,
	bankNo=p_bankNo,
	updatedBy=p_userId,
	paymentMode=p_paymentMode,
	updatedDate=NOW()
	WHERE
	vendorId=P_vendor ;
	END IF;
	
-- For delete start
	IF p_mode=4
	THEN
	
	UPDATE tbl_vendor 
	SET	deleted='Y',updatedBy=p_userId,updatedDate=NOW()
	WHERE vendorId=P_vendor and deleted='N';
	
	UPDATE tbl_users
	SET	deleted='Y',updatedBy=p_userId,updatedDate=NOW()
	WHERE linkId=P_vendor  AND userType='vendor' AND deleted='N';
	UPDATE `tbl_vendor_category` 
	SET deleted='Y',updatedBy=p_userId,updatedDate=NOW()
	WHERE vendorId=P_vendor and deleted='N';
	UPDATE `tbl_user_vendor_society_mapping` 
	SET deleted='Y',updatedBy=p_userId,updatedDate=NOW()
	WHERE vendorUserId=(SELECT userId FROM tbl_users WHERE linkId=P_vendor AND userType='vendor' AND deleted='N') 
	AND deleted='N';
	UPDATE `tbl_user_vendor_offers` 
	SET deleted='Y',updatedBy=p_userId,updatedDate=NOW()
	WHERE vendorUserId=(SELECT userId FROM tbl_users WHERE linkId=P_vendor  AND userType='vendor' AND deleted='N')
	and deleted='N';
        
        UPDATE `tbl_user_vendor_society_offers_mapping` 
	SET deleted='Y',updatedBy=p_userId,updatedDate=NOW()
	WHERE createdBy=(SELECT userId FROM tbl_users WHERE linkId=P_vendor  AND userType='vendor' AND deleted='N')
	and  deleted='N';
END IF;
-- For delete end
	
	
    END */$$
DELIMITER ;

