/* Procedure structure for procedure `proc_vendor_society_list_app` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_vendor_society_list_app` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_vendor_society_list_app`(
    p_type VARCHAR(55),
    p_userId INT(11)
/*
call proc_vendor_society_list_app ('all',8)
*/    
    
    )
BEGIN
        UPDATE tbl_user_vendor_society_mapping 	SET flag='Y' WHERE DATEDIFF(validTo,DATE(NOW()))<=15;
        UPDATE tbl_user_vendor_society_mapping 	SET flag='N' WHERE DATEDIFF(validTo,DATE(NOW()))>=15;
	IF p_type = 'unlink'
	THEN
		SELECT t1.societyId,t1.societyName,t1.address,(SELECT COUNT(flatId) AS total FROM `tbl_flat_contact_mobile` WHERE deleted='N') AS userCount,
		(SELECT COUNT(flatId) FROM `tbl_flat` WHERE societyId=t1.societyId AND deleted='N')flatCount
		FROM tbl_society AS t1 
		LEFT JOIN `tbl_flat` AS t2 ON t1.societyId=t2.societyId AND t2.deleted='N'
		LEFT JOIN `tbl_flat_contact_names` AS t3 ON t2.flatId=t3.flatId AND t3.deleted='N'
		LEFT JOIN `tbl_flat_contact_mobile` AS t4 ON t3.flatContactNameId=t4.flatContactNameId AND t4.deleted='N'
		WHERE t1.deleted='N' AND t1.societyId NOT IN 
		(SELECT societyId FROM tbl_user_vendor_society_mapping WHERE deleted='N' 
		AND vendorUserId  = p_userId AND `status` IN ('Approved','Pending')) 
		GROUP BY t1.societyId ORDER BY COUNT(t4.flatContactNameId)DESC;
	END IF;
	
	IF p_type = 'link'
	THEN
		SELECT  t1.societyId,t1.societyName,t2.validTo,t2.Flag,address FROM `tbl_society` AS t1 
		LEFT JOIN `tbl_user_vendor_society_mapping` AS t2 ON t1.societyId = t2.societyId
		WHERE t1.deleted='N' AND t2.vendorUserId = p_userId AND t2.deleted = 'N' AND t2.`status` = 'Approved'
		AND validTo >=DATE(NOW()) GROUP BY t1.societyId;
	END IF;
	
	IF p_type = 'All'
	THEN
		
		DELETE FROM `tmp_user_vendor_society_mapping`
		where connectionId=connection_id();
		
		INSERT INTO `tmp_user_vendor_society_mapping`
		(societyId,societyName,flatCount,societyImage,address,connectionId
		)
		SELECT t1.societyId,t1.societyName,
		(SELECT COUNT(flatId) FROM `tbl_flat` WHERE societyId=t1.societyId AND deleted='N')flatCount,
		(SELECT CONCAT(`name`,'uploads/societyImage/',t1.societyImage) FROM `tbl_common_url` WHERE urlType='url') AS societyImage,
		address,CONNECTION_ID()		
		FROM `tbl_society` AS t1
		WHERE t1.deleted='N' 
		ORDER BY t1.societyId;
		
		UPDATE tmp_user_vendor_society_mapping 
		JOIN (SELECT t1.societyId,t2.status,
		MAX(t2.validTo) AS validTo,t2.Flag	
		FROM `tbl_society` AS t1
		LEFT JOIN `tbl_user_vendor_society_mapping` AS t2 ON t1.societyId = t2.societyId AND t2.deleted='N'
		AND t2.vendorUserId = p_userId  AND t2.status != 'Rejected'
		WHERE t1.deleted='N' AND
		CASE WHEN IFNULL(NULLIF(t2.validTo,''),'') =''
		THEN
		1=1
		ELSE
		t2.validTo>=DATE(NOW()) 
		END AND `status` ='Approved' GROUP BY t1.societyId
		ORDER BY t1.societyId,IFNULL(t2.Flag,'')DESC)a ON tmp_user_vendor_society_mapping.societyId=a.societyId
		SET tmp_user_vendor_society_mapping.status=a.status,tmp_user_vendor_society_mapping.validTo=a.validTo,
		tmp_user_vendor_society_mapping.Flag=a.Flag,tmp_user_vendor_society_mapping.statusApproved='Y'
		where connectionId=CONNECTION_ID();
		
		UPDATE tmp_user_vendor_society_mapping 
		JOIN (SELECT t1.societyId,t2.status,
		MAX(t2.validTo) AS validTo,t2.Flag	
		FROM `tbl_society` AS t1
		LEFT JOIN `tbl_user_vendor_society_mapping` AS t2 ON t1.societyId = t2.societyId 
		AND t2.vendorUserId = p_userId  AND t2.status != 'Rejected'
		WHERE t1.deleted='N' AND
		CASE WHEN IFNULL(NULLIF(t2.validTo,''),'') =''
		THEN 1=1 ELSE
		t2.validTo>=DATE(NOW()) 
		END AND `status` ='Pending' GROUP BY t1.societyId
		ORDER BY t1.societyId,IFNULL(t2.Flag,'')DESC)a
		ON tmp_user_vendor_society_mapping.societyId=a.societyId
		SET tmp_user_vendor_society_mapping.statusPending='Y'
		where connectionId=CONNECTION_ID();
		
		update tmp_user_vendor_society_mapping
		set statusName=CASE WHEN statusApproved = 'Y' AND statusPending = 'Y' THEN 'Approved&Pending'
		WHEN statusApproved = 'N' AND statusPending = 'Y' THEN 'Pending'
		WHEN statusApproved = 'Y' AND statusPending = 'N' THEN 'Approved'
		ELSE 'Send Request' END 
		where connectionId=CONNECTION_ID();
                		
		
		-- SELECT (SELECT COUNT(flatId) FROM `tbl_flat_contact_mobile` WHERE deleted='N' AND flatContactNameId IN (
-- 		SELECT flatContactNameId FROM `tbl_flat_contact_names` WHERE deleted='N' AND flatId IN(
-- 		SELECT flatId FROM `tbl_flat` WHERE societyId = t1.societyId AND deleted='N')))userCount,
-- 		t1.societyId,t1.societyName,t1.flatCount,t1.societyImage,DATE_FORMAT(t1.validTo,'%d-%b-%Y') validTo,
-- 		 CASE WHEN DATEDIFF(validTo,DATE(NOW()))<=15 THEN 'Y'
--                     WHEN DATEDIFF(validTo,DATE(NOW()))>=15 THEN 'N' 
--                     ELSE t1.Flag END Flag
--                     ,t1.address,t1.`status`,
-- 		statusName 
-- 		FROM `tmp_user_vendor_society_mapping` AS t1
-- 		where connectionId=CONNECTION_ID()
-- 		order by statusName,t1.validTo;
SELECT (SELECT COUNT(flatId) AS total FROM `tbl_flat_contact_mobile` WHERE deleted='N'
)userCount,
 		t1.societyId,t1.societyName,t1.flatCount,t1.societyImage,DATE_FORMAT(t1.validTo,'%d-%b-%Y') validTo,
 		 CASE WHEN DATEDIFF(validTo,DATE(NOW()))<=15 THEN 'Y'
                     WHEN DATEDIFF(validTo,DATE(NOW()))>=15 THEN 'N' 
               ELSE t1.Flag END Flag
                     ,t1.address,t1.`status`,
 		statusName 
 		FROM `tmp_user_vendor_society_mapping` AS t1
 		where connectionId=CONNECTION_ID()
 		order by statusName,t1.validTo;
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_vendor_society_offer_app` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_vendor_society_offer_app` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_vendor_society_offer_app`(
  p_mode INT(11),
  p_offerId INT(11),   
  p_userId INT(11),  
  p_societyId varchar(900),   
  p_offerName VARCHAR(55),   
  p_description TEXT,   
  p_offerImage VARCHAR(55), 
  p_imageUrl  VARCHAR(255),
  p_offerValidFrom VARCHAR(55),   
  p_offerValidTo VARCHAR(55),
  p_all   varchar(1)  
    )
BEGIN
	IF p_mode = 0
	THEN
	INSERT INTO tbl_user_vendor_offers 
	(vendorUserId,offerName,description,offerImage,offerValidFrom,offerValidTo,`all`,createdBy)
	VALUES(p_userId,p_offerName,p_description,p_offerImage,
		DATE_FORMAT(STR_TO_DATE(p_offerValidFrom,'%d-%m-%Y'),'%Y-%m-%d'),
		DATE_FORMAT(STR_TO_DATE(p_offerValidTo,'%d-%m-%Y'),'%Y-%m-%d'),p_all,p_userId);
		
insert 	tbl_user_vendor_society_offers_mapping(vendorOfferId,societyId,createdBy)
SELECT DISTINCT LAST_INSERT_ID(),SUBSTRING_INDEX(SUBSTRING_INDEX(p_societyId, ',', numbers.n), ',', -1)p_societyId,
p_userId		
FROM numbers; 	
 	SELECT '200' AS responseCode,'Vendor Offer added successfully' AS responseMessage;
	END IF;
	
	
	IF p_mode = 1
	THEN
		
		UPDATE tbl_user_vendor_offers
		SET
		vendorUserId = p_userId,offerName = p_offerName,
		description = p_description,offerImage = IFNULL(NULLIF(p_offerImage,''),offerImage),
		offerValidFrom = DATE_FORMAT(STR_TO_DATE(p_offerValidFrom,'%d-%m-%Y'),'%Y-%m-%d'),
		offerValidTo = DATE_FORMAT(STR_TO_DATE(p_offerValidTo,'%d-%m-%Y'),'%Y-%m-%d'),
		`all`=p_all,updatedBy = p_userId,updatedDate = NOW()
		WHERE
		vendorOfferId = p_offerId;
		UPDATE tbl_user_vendor_offers SET flag='N' 
		WHERE DATEDIFF(offerValidTo,DATE(NOW()))>=15
		AND vendorOfferId = p_offerId;
                delete from `tbl_user_vendor_society_offers_mapping`
                where vendorOfferId=p_offerId;
                
                insert 	tbl_user_vendor_society_offers_mapping(vendorOfferId,societyId,createdBy)
                select DISTINCT p_offerId,SUBSTRING_INDEX(SUBSTRING_INDEX(p_societyId, ',', numbers.n), ',', -1),
		p_userId		
		FROM numbers; 	
		SELECT '200' AS responseCode,'Vendor Offer updated successfully' AS responseMessage;
	END IF;
	
	
	
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_vendor_society_offer_list_app` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_vendor_society_offer_list_app` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`lokesh`@`%` PROCEDURE `proc_vendor_society_offer_list_app`(
-- call proc_vendor_society_offer_list_app(4,0)
    p_userId INT(11),
    p_offerId INT(11)
    )
BEGIN
		delete from tmp_vendor_society_offer_list_app
		where connectionId=connection_ID();
		UPDATE tbl_user_vendor_offers SET flag='Y' WHERE DATEDIFF(offerValidTo,DATE(NOW()))<=15 ;
		
		insert tmp_vendor_society_offer_list_app
		SELECT  t2.societyId,t1.vendorOfferId,t1.offerName,t1.description,t1.flag,
		(SELECT CONCAT(`name`,'uploads/vendorOfferImages/',t1.offerImage) FROM `tbl_common_url` WHERE urlType='url')offerImage,
		t1.offerValidFrom AS validFrom,
		t1.offerValidTo AS validTo,t1.status,
		(SELECT s.societyName FROM  `tbl_society` s
		WHERE t2.vendorOfferId=t1.vendorOfferId AND t2.deleted=s.deleted 
		AND t2.deleted='N' AND t2.societyId=s.societyId
		)societyName,`all`,35,100,connection_id() 
		FROM `tbl_user_vendor_offers` AS t1 ,tbl_user_vendor_society_offers_mapping t2
		WHERE t1.vendorOfferId=t2.vendorOfferId
		and t1.deleted = 'N'  AND t2.deleted='N' 
--		AND DATE(NOW()) BETWEEN t1.offerValidFrom AND t1.offerValidTo
		AND t1.vendorUserId = p_userId;
				
		select 
		(SELECT COUNT(viewUserId) FROM `tbl_user_vendor_offers_viewed` WHERE deleted='N' 
		AND vendorOfferId=tmp_vendor_society_offer_list_app.vendorOfferId)viewUserCount,group_CONCAT(societyId)societyId,`vendorOfferId`,`offerName`,`description`,`flag`,`offerImage`,
			DATE_FORMAT(validFrom,'%d-%b-%Y') AS validFrom,DATE_FORMAT(validTo,'%d-%b-%Y') AS validTo,
		`status`,
		CASE WHEN `all`='Y' THEN 'All societies'else `societyName`end societyName,
		`all`,viewCount,totalUser,concat(round(viewCount/totalUser*100,0),' %') viewCounter
		 from tmp_vendor_society_offer_list_app
		where connectionId=CONNECTION_ID()
		group by `vendorOfferId`,`offerName`,`description`,`flag`,`offerImage`,validFrom,validTo,`status`,`all`,viewCount,totalUser;	
				
		DELETE FROM tmp_vendor_society_offer_list_app
		WHERE connectionId=CONNECTION_ID();		
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_vendor_society_request_app` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_vendor_society_request_app` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_vendor_society_request_app`(
    p_userId INT(11),
    p_societyId INT(11),
    p_remark TEXT
    )
BEGIN
	
	INSERT INTO `tbl_user_vendor_society_mapping`(vendorUserId,societyId,remark,createdBy)
	VALUES
	(p_userId,p_societyId,p_remark,p_userId);
	
	UPDATE tbl_user_vendor_society_mapping 	SET flag='Y' WHERE DATEDIFF(validTo,DATE(NOW()))<=15;
        UPDATE tbl_user_vendor_society_mapping 	SET flag='N' WHERE DATEDIFF(validTo,DATE(NOW()))>=15;
	
		/*SELECT  t1.societyId,t1.societyName,t2.status,COUNT(t4.flatContactNameId) AS userCount,
		(SELECT COUNT(flatId) FROM `tbl_flat` WHERE societyId=t1.societyId AND deleted='N')flatCount,
		(SELECT CONCAT(`name`,'uploads/societyImage/',t1.societyImage) FROM `tbl_common_url` WHERE urlType='url') AS societyImage,
		CASE WHEN t2.status = 'Approved' 
		THEN
		'Approved'
		WHEN t2.status = 'Pending' 
		THEN
		'Pending'
		ELSE
		'Send Request'
		END 
		statusName,DATE_FORMAT(t2.validTo,'%d-%b-%Y') AS validTo,t2.Flag,address		
		FROM `tbl_society` AS t1
		LEFT JOIN `tbl_user_vendor_society_mapping` AS t2 ON t1.societyId = t2.societyId 
		AND t2.vendorUserId = p_userId  AND t2.status != 'Rejected'
		-- AND DATE(NOW()) BETWEEN validFrom AND validTo
		LEFT JOIN `tbl_flat` AS t3 ON t1.societyId=t3.societyId AND t3.deleted='N'
		LEFT JOIN `tbl_flat_contact_names` AS t4 ON t3.flatId=t4.flatId AND t4.deleted='N'
		LEFT JOIN `tbl_flat_contact_mobile` AS t5 ON t4.flatContactNameId=t5.flatContactNameId AND t5.deleted='N'
		WHERE t1.deleted='N' GROUP BY t1.societyId
		ORDER BY IFNULL(t2.Flag,'')DESC,COUNT(t4.flatContactNameId) DESC;*/
		
		DELETE FROM `tmp_user_vendor_society_mapping`
		WHERE connectionId=CONNECTION_ID();
		
		INSERT INTO `tmp_user_vendor_society_mapping`
		(societyId,societyName,flatCount,societyImage,address,connectionId
		)
		SELECT t1.societyId,t1.societyName,
		(SELECT COUNT(flatId) FROM `tbl_flat` WHERE societyId=t1.societyId AND deleted='N')flatCount,
		(SELECT CONCAT(`name`,'uploads/societyImage/',t1.societyImage) FROM `tbl_common_url` WHERE urlType='url') AS societyImage,
		address,CONNECTION_ID()		
		FROM `tbl_society` AS t1
		WHERE t1.deleted='N' 
		ORDER BY t1.societyId;
		
		UPDATE tmp_user_vendor_society_mapping 
		JOIN (SELECT t1.societyId,t2.status,
		MAX(t2.validTo) AS validTo,t2.Flag	
		FROM `tbl_society` AS t1
		LEFT JOIN `tbl_user_vendor_society_mapping` AS t2 ON t1.societyId = t2.societyId AND t2.deleted='N'
		AND t2.vendorUserId = p_userId  AND t2.status != 'Rejected'
		WHERE t1.deleted='N' AND
		CASE WHEN IFNULL(NULLIF(t2.validTo,''),'') =''
		THEN
		1=1
		ELSE
		t2.validTo>=DATE(NOW()) 
		END AND `status` ='Approved' GROUP BY t1.societyId
		ORDER BY t1.societyId,IFNULL(t2.Flag,'')DESC)a ON tmp_user_vendor_society_mapping.societyId=a.societyId
		SET tmp_user_vendor_society_mapping.status=a.status,tmp_user_vendor_society_mapping.validTo=a.validTo,
		tmp_user_vendor_society_mapping.Flag=a.Flag,tmp_user_vendor_society_mapping.statusApproved='Y'
		WHERE connectionId=CONNECTION_ID();
		
		UPDATE tmp_user_vendor_society_mapping 
		JOIN (SELECT t1.societyId,t2.status,
		MAX(t2.validTo) AS validTo,t2.Flag	
		FROM `tbl_society` AS t1
		LEFT JOIN `tbl_user_vendor_society_mapping` AS t2 ON t1.societyId = t2.societyId 
		AND t2.vendorUserId = p_userId  AND t2.status != 'Rejected'
		WHERE t1.deleted='N' AND
		CASE WHEN IFNULL(NULLIF(t2.validTo,''),'') =''
		THEN 1=1 ELSE
		t2.validTo>=DATE(NOW()) 
		END AND `status` ='Pending' GROUP BY t1.societyId
		ORDER BY t1.societyId,IFNULL(t2.Flag,'')DESC)a
		ON tmp_user_vendor_society_mapping.societyId=a.societyId
		SET tmp_user_vendor_society_mapping.statusPending='Y'
		WHERE connectionId=CONNECTION_ID();
		
		UPDATE tmp_user_vendor_society_mapping
		SET statusName=CASE WHEN statusApproved = 'Y' AND statusPending = 'Y' THEN 'Approved&Pending'
		WHEN statusApproved = 'N' AND statusPending = 'Y' THEN 'Pending'
		WHEN statusApproved = 'Y' AND statusPending = 'N' THEN 'Approved'
		ELSE 'Send Request' END 
		WHERE connectionId=CONNECTION_ID();
                		
		
		SELECT (SELECT COUNT(flatId) FROM `tbl_flat_contact_mobile` WHERE deleted='N' AND flatContactNameId IN (
		SELECT flatContactNameId FROM `tbl_flat_contact_names` WHERE deleted='N' AND flatId IN(
		SELECT flatId FROM `tbl_flat` WHERE societyId = t1.societyId AND deleted='N')))userCount,
		t1.societyId,t1.societyName,t1.flatCount,t1.societyImage,DATE_FORMAT(t1.validTo,'%d-%b-%Y') validTo,
		 CASE WHEN DATEDIFF(validTo,DATE(NOW()))<=15 THEN 'Y'
                    WHEN DATEDIFF(validTo,DATE(NOW()))>=15 THEN 'N' 
                    ELSE t1.Flag END Flag
                    ,t1.address,t1.`status`,
		statusName 
		FROM `tmp_user_vendor_society_mapping` AS t1
		WHERE connectionId=CONNECTION_ID()
		ORDER BY statusName,t1.validTo;
	
	
    END */$$
DELIMITER ;

